INSERT INTO `article` VALUES (1145700786368102401, '浅谈自动化测试（一）', '使用nightwatch构建自动化脚本', 'https://pan.zealsay.com/20190701222747340000000.jpg', '# 前言 \n\n随着互联网的发展，人工智能和自动化是未来的一大趋势，目前随着敏捷开发模式的流行，持续集成和持续交付的开发过程，对于开发-测试-部署都是非常高的要求，近些年，伴随着docker容器技术的发展，目前市面上的自动化部署已经层出不穷，然而对于自动化测试这快，虽然也有很多框架或技术，但是却很难找到一款能够适合自己的，如何才能利用现有的这些技术，能够实现高效可靠的自动化测试呢？当然，这是一个过程，就像其他的devops一样，都是一个不断进步和完善的过程。\n\n[![](http://www.uml.org.cn/SoftWareProcess/images/2015122311.jpg)](http://www.uml.org.cn/SoftWareProcess/images/2015122311.jpg)\n\n\n------------\n\n\n\n# 自动化测试\n\n1、了解自动化测试\n\n- 什么是自动化测试？\n概念：把人为驱动的测试转化为机器执行的一种过程，重点在于持续集成这个概念。\n\n- 为什么要自动化测试？\n假如能够有一个成熟的解决方案来代替我们传统人工的测试过程，那么这将能够节省大量的人力成本和时间成本。\n\n[![](https://i.loli.net/2018/10/26/5bd2ba4f85b3b.png)](https://i.loli.net/2018/10/26/5bd2ba4f85b3b.png)\n\n如上图所示，敏捷大师Mike Cohn提出该概念，然后由Martin Fowler大师在此基础上提出了测试分层概念，以区别于传统的自动化测试。\n\n2、自动化测试分层\n\n单元自动化测试（数据处理层）：指对软件中最小的可测试单元进行检查和验证，一般需要借助单元测试框架，如java的Junit、TestNG，python的unittest，常见的手段是code review等；\n\n接口自动化测试（业务逻辑层）：主要检查验证模块间的调用返回以及不同系统、服务间的数据交换，常见的接口测试工具有postman、jmeter、loadrunner等；\n\nUI自动化测试（GUI界面层）：UI层是用户使用产品的入口，所有功能通过这一层提供给用户，测试工作大多集中在这一层，常见的测试工具有UFT、Robot Framework、Selenium、Appium等；\n\n性价比：按照测试金字塔模型以及投入/产出比，越向下，回报率越高；\n\nGoogle的自动化分层投入占比：\n\n小测试（Unit）：占比70%；\n\n中测试（Service）：占比20%；\n\n大测试（UI）：占比10%；\n\n自动化测试面临的挑战：面临的最大挑战就是变化，因为变化会导致测试用例运行失败，所以需要对自动化脚本不断debug，如何控制成本、降低成本是对自动化测试工具以及人员能力的挑战。\n\n3、什么样的项目适合自动化测试\n\n\n[![](https://i.loli.net/2018/10/26/5bd2baf56266f.png)](https://i.loli.net/2018/10/26/5bd2baf56266f.png)\n\n如上图所示，真正工作中无法全部满足以上条件，所以需要作出权衡，一般来说，只需要满足以下几点，就可以对项目开展自动化测试（图中红色框标注的选项）：\n\n①需求稳定，不会频繁变更\n\n自动化测试最大的挑战就是需求的变化，而自动化脚本本身就需要修改、扩展、debug，去适应新的功能，如果投入产出比太低，那么自动化测试也失去了其价值和意义；\n\n折中的做法是选择相对稳定的模块和功能进行自动化测试，变动较大、需求变更较频繁的部分用手工测试；\n\n②多平台运行，组合遍历型、大量的重复任务\n\n测试数据、测试用例、自动化脚本的重用性和移植性较强，降低成本，提高效率和价值；\n\n③软件维护周期长，有生命力\n\n自动化测试的需求稳定性要求、自动化框架的设计、脚本开发与调试均需要时间，这其实也是一个软件开发过程，如果项目周期较短，没有足够的时间去支持这一过程，那自动化测试也就不需要了；\n\n④被测系统开发较为规范，可测试性强\n\n主要出于这几点考虑：被测试系统的架构差异、测试技术和工具的适应性、测试人员的能力能否设计开发出适应差异的自动化测试框架；\n\n4、常见的自动化测试工具简介\n\n#### UFT（Unified Functional Testing）\n\n即原来的QTP（Quick Test Professional Software）与ST（Service Test）合并而来，由HP公司开发，是一个企业级的商业自动化测试工具，提供了强大易用的录制回放功能，\n\n同时兼容对象识别模式与图像识别模式，支持B/S和C/S两种架构的软件测试；\n\n#### Robot Framework\n\n一款基于python语言编写的自动化测试框架工具，具备良好的扩展性，支持关键字驱动，支持多种类型的客户端和接口，可进行分布式测试；\n\n#### SeleniumSelenium\n\n应用于web的自动化测试工具，支持多平台、多浏览器、多语言来实现自动化，优点如下：\n\n①开源、免费；\n\n②多浏览器支持：chrome、Firefox、IE、Edge等；\n\n③多平台支持：Linux、Windows、MAC；\n\n④多语言支持：java、python、Ruby、C#、JavaScript、C++；\n\n⑤对web界面有良好的支持；\n\n⑥简单（API简单）、灵活（开发语言驱动）；\n\n⑦支持分布式测试用例执行； \n\n#### Nightwatch\n由Node.js驱动的自动化测试框架，使用W3C Webdriver（以前的是Selenium）。\n\nNightwatch是一个完整的集成解决方案，用于web应用程序和网站的端到端测试，以及用于Node.js单元和集成测试。\n\ngithub地址为：https://github.com/nightwatchjs/nightwatch 目前该项目在github上已经超过8.6k star，是一个比较火热的自动化测试框架。\n官网地址为 http://nightwatchjs.org/\n\n下一篇我讲介绍如何使用\n', '<h1><a id=\"_0\"></a>前言</h1>\n<p>随着互联网的发展，人工智能和自动化是未来的一大趋势，目前随着敏捷开发模式的流行，持续集成和持续交付的开发过程，对于开发-测试-部署都是非常高的要求，近些年，伴随着docker容器技术的发展，目前市面上的自动化部署已经层出不穷，然而对于自动化测试这快，虽然也有很多框架或技术，但是却很难找到一款能够适合自己的，如何才能利用现有的这些技术，能够实现高效可靠的自动化测试呢？当然，这是一个过程，就像其他的devops一样，都是一个不断进步和完善的过程。</p>\n<p><a href=\"http://www.uml.org.cn/SoftWareProcess/images/2015122311.jpg\" target=\"_blank\"><img src=\"http://www.uml.org.cn/SoftWareProcess/images/2015122311.jpg\" alt=\"\" /></a></p>\n<hr />\n<h1><a id=\"_11\"></a>自动化测试</h1>\n<p>1、了解自动化测试</p>\n<ul>\n<li>\n<p>什么是自动化测试？<br />\n概念：把人为驱动的测试转化为机器执行的一种过程，重点在于持续集成这个概念。</p>\n</li>\n<li>\n<p>为什么要自动化测试？<br />\n假如能够有一个成熟的解决方案来代替我们传统人工的测试过程，那么这将能够节省大量的人力成本和时间成本。</p>\n</li>\n</ul>\n<p><a href=\"https://i.loli.net/2018/10/26/5bd2ba4f85b3b.png\" target=\"_blank\"><img src=\"https://i.loli.net/2018/10/26/5bd2ba4f85b3b.png\" alt=\"\" /></a></p>\n<p>如上图所示，敏捷大师Mike Cohn提出该概念，然后由Martin Fowler大师在此基础上提出了测试分层概念，以区别于传统的自动化测试。</p>\n<p>2、自动化测试分层</p>\n<p>单元自动化测试（数据处理层）：指对软件中最小的可测试单元进行检查和验证，一般需要借助单元测试框架，如java的Junit、TestNG，python的unittest，常见的手段是code review等；</p>\n<p>接口自动化测试（业务逻辑层）：主要检查验证模块间的调用返回以及不同系统、服务间的数据交换，常见的接口测试工具有postman、jmeter、loadrunner等；</p>\n<p>UI自动化测试（GUI界面层）：UI层是用户使用产品的入口，所有功能通过这一层提供给用户，测试工作大多集中在这一层，常见的测试工具有UFT、Robot Framework、Selenium、Appium等；</p>\n<p>性价比：按照测试金字塔模型以及投入/产出比，越向下，回报率越高；</p>\n<p>Google的自动化分层投入占比：</p>\n<p>小测试（Unit）：占比70%；</p>\n<p>中测试（Service）：占比20%；</p>\n<p>大测试（UI）：占比10%；</p>\n<p>自动化测试面临的挑战：面临的最大挑战就是变化，因为变化会导致测试用例运行失败，所以需要对自动化脚本不断debug，如何控制成本、降低成本是对自动化测试工具以及人员能力的挑战。</p>\n<p>3、什么样的项目适合自动化测试</p>\n<p><a href=\"https://i.loli.net/2018/10/26/5bd2baf56266f.png\" target=\"_blank\"><img src=\"https://i.loli.net/2018/10/26/5bd2baf56266f.png\" alt=\"\" /></a></p>\n<p>如上图所示，真正工作中无法全部满足以上条件，所以需要作出权衡，一般来说，只需要满足以下几点，就可以对项目开展自动化测试（图中红色框标注的选项）：</p>\n<p>①需求稳定，不会频繁变更</p>\n<p>自动化测试最大的挑战就是需求的变化，而自动化脚本本身就需要修改、扩展、debug，去适应新的功能，如果投入产出比太低，那么自动化测试也失去了其价值和意义；</p>\n<p>折中的做法是选择相对稳定的模块和功能进行自动化测试，变动较大、需求变更较频繁的部分用手工测试；</p>\n<p>②多平台运行，组合遍历型、大量的重复任务</p>\n<p>测试数据、测试用例、自动化脚本的重用性和移植性较强，降低成本，提高效率和价值；</p>\n<p>③软件维护周期长，有生命力</p>\n<p>自动化测试的需求稳定性要求、自动化框架的设计、脚本开发与调试均需要时间，这其实也是一个软件开发过程，如果项目周期较短，没有足够的时间去支持这一过程，那自动化测试也就不需要了；</p>\n<p>④被测系统开发较为规范，可测试性强</p>\n<p>主要出于这几点考虑：被测试系统的架构差异、测试技术和工具的适应性、测试人员的能力能否设计开发出适应差异的自动化测试框架；</p>\n<p>4、常见的自动化测试工具简介</p>\n<h4><a id=\"UFTUnified_Functional_Testing_72\"></a>UFT（Unified Functional Testing）</h4>\n<p>即原来的QTP（Quick Test Professional Software）与ST（Service Test）合并而来，由HP公司开发，是一个企业级的商业自动化测试工具，提供了强大易用的录制回放功能，</p>\n<p>同时兼容对象识别模式与图像识别模式，支持B/S和C/S两种架构的软件测试；</p>\n<h4><a id=\"Robot_Framework_78\"></a>Robot Framework</h4>\n<p>一款基于python语言编写的自动化测试框架工具，具备良好的扩展性，支持关键字驱动，支持多种类型的客户端和接口，可进行分布式测试；</p>\n<h4><a id=\"SeleniumSelenium_82\"></a>SeleniumSelenium</h4>\n<p>应用于web的自动化测试工具，支持多平台、多浏览器、多语言来实现自动化，优点如下：</p>\n<p>①开源、免费；</p>\n<p>②多浏览器支持：chrome、Firefox、IE、Edge等；</p>\n<p>③多平台支持：Linux、Windows、MAC；</p>\n<p>④多语言支持：java、python、Ruby、C#、JavaScript、C++；</p>\n<p>⑤对web界面有良好的支持；</p>\n<p>⑥简单（API简单）、灵活（开发语言驱动）；</p>\n<p>⑦支持分布式测试用例执行；</p>\n<h4><a id=\"Nightwatch_100\"></a>Nightwatch</h4>\n<p>由Node.js驱动的自动化测试框架，使用W3C Webdriver（以前的是Selenium）。</p>\n<p>Nightwatch是一个完整的集成解决方案，用于web应用程序和网站的端到端测试，以及用于Node.js单元和集成测试。</p>\n<p>github地址为：https://github.com/nightwatchjs/nightwatch 目前该项目在github上已经超过8.6k star，是一个比较火热的自动化测试框架。<br />\n官网地址为 http://nightwatchjs.org/</p>\n<p>下一篇我讲介绍如何使用</p>\n', 'FORMAL', 'ALL', 'javascript,devops', 52, 0, 1, 1, '2019-07-01 22:28:48', '2019-07-06 11:44:35', 0);
INSERT INTO `article` VALUES (1145701104266985474, '浅谈自动化测试(二)', '使用nightwatch构建自动化脚本', 'https://pic.zealsay.com/article/20200709012715929000000.jpg', '# Nightwatch介绍 \n\n在介绍Nightwatch之前，同样有一个自动化测试的脚本语言phantomjs，这个phantomjs是一个无界面的方式实现自动化测试的，优缺点对比也很明显，当然，有一些就是用后者来实现后台爬虫的。\n\n\n| Nightwatch         |   phantomjs    | \n| ----------   | -----  | \n| 有界面     | 无界面  |  \n| API丰富	        |   API有点不够用   | \n| 直接调用webDriver，兼容性好       |    通过Selenium调用各个浏览器驱动，兼容性略差   |  \n\n<!--more-->\n\n\n\n# 安装Nightwatch\n\n```shell\n# 在当前项目中安装\nnpm i -D nightwatch\n\n# 或者全局安装\nnpm i -g nightwatch\n\n```\n\nNightwatch有两种方式去调起浏览器跑测试\n\n1. 通过Selenium，调各个浏览器的webDriver唤起浏览器。这个需要安装java、Selenium、webDriver\n1. 直接通过各家浏览器的webDriver调起对应的浏览器。\n\n我选择了第二种，这里就需要去安装的chrome的webDriver，有个npm包帮我们做了这个事\n\n```shell\nnpm i -D chromedriver\n```\n安装的时候可能会遇到\'网络问题\'，在根目录下新建一个.npmrc文件,指定一下下载路径\n\n```shell\nchromedriver_cdnurl=https://npm.taobao.org/mirrors/chromedriver\n```\n\n或者更直接\n\n```shell\nnpm install chromedriver --chromedriver_cdnurl=https://npm.taobao.org/mirrors/chromedriver\n```\n\n# 配置文件nightwatch.json\n\nNightwatch启动的时候默认会去加载nightwatch.json配置文件，nightwatch.js也行，这里贴上我的配置文件，并对一些常用的字段做一下说明，其余看文档就行\n\n```json\n{\n  \"src_folders\": [\"test/ui\"],\n  \"output_folder\": \"reports\",\n  \"custom_commands_path\": \"\",\n  \"custom_assertions_path\": \"\",\n  \"page_objects_path\": \"\",\n  \"globals_path\": \"./webDriver.js\",\n\n  \"selenium\": {\n    \"start_process\": false\n  },\n\n  \"test_settings\": {\n    \"default\": {\n      \"selenium_port\": 9515,\n      \"selenium_host\": \"localhost\",\n      \"default_path_prefix\": \"\",\n\n      \"desiredCapabilities\": {\n        \"browserName\": \"chrome\",\n        \"chromeOptions\": {\n          \"args\": [\n            \"--no-sandbox\",\n            \"user-data-dir=/Users/shenshuaijia/Library/Application Support/Google/Chrome\"\n          ]\n        },\n        \"acceptSslCerts\": true\n      },\n      \"globals\": {\n        \"domain\": \"http://www.zealsay.com\"\n      }\n    }\n  }\n}\n\n```\n\n- src_folders: 指定测试用例的文件夹，里面所有的js文件测试的时候都会被执行\n- output_folder： 指定产生报告存放的路径\n- globals_path： 全局模块路径，nightwatch启动时还会去加载这个路径下的模块，比如我们刚刚下载了Chromedriver，我们需要写个模块文件，简单包装一下暴露出来被nightwatch加载。 这是我根目录下的webDriver.js文件，这样的话，nightwatch就能通过这个文件调webdriver然后启动浏览器了\n\n```javascript\nconst chromedriver = require(\'chromedriver\')\n\nmodule.exports = {\n  before: function(done) {\n    chromedriver.start()\n    done()\n  },\n\n  after: function(done) {\n    chromedriver.stop()\n    done()\n  }\n}\n```\n\n- selenium： selenium的配置，因为我选择了第二中安装方式，所以要禁用掉selenium\n- test_settings：启动测试时的一些配置，每一个key对应一套配置，比如通过命令nightwatch --env default使用default那一套配置，也可以用nightwatch --env integration来运行integration那套配置，但需要事先在test_settings中有配置\n- desiredCapabilities：这个是对Chromdriver能力配置，具体的话，就需要查看Chromdriver的文档\n这里我遇到了一个比较特殊的情况，我需要使用平时使用chrome留下的cookie，而不是完全的沙盒模式，所以，我这里需要启动chromedriver的时候，指定加载chrome用户数据的文件夹\"user-data-dir=/Users/shenshuaijia/Library/Application Support/Google/Chrome\"，这样所有的登录信息都能在测试的时候被使用。\n\n- globals： 在测试的时候，也可以定义一下全局变量，方便测试的时候使用,这里我定义了一个domain，写测试的时候可以在browser.globals.domain获取\n\n# 编写测试\n\n在test/ui文件夹下新建一个测试文件page.test.js\n\n```javascript\nmodule.exports = {\n  \'Demo test Google\' : function (browser) {\n    browser\n      .url(\'http://www.google.com\')\n      .waitForElementVisible(\'body\', 1000)\n      .setValue(\'input[type=text]\', \'nightwatch\')\n      .waitForElementVisible(\'button[name=btnG]\', 1000)\n      .click(\'button[name=btnG]\')\n      .pause(1000)\n      .assert.containsText(\'#main\', \'Night Watch\')\n      .end();\n  }\n}\n```\n\nnightwatch拥有比较优雅的测试写法。这里就是简单打开一个谷歌页面，往输入框输入nightwatch然后点击按钮。记住所有的测试完成后需要调end方法来退出浏览量。nightwatch也可以定义一些钩子函数\n\n```javascript\nmodule.exports = {\n  before : function(browser) {\n    console.log(\'Setting up...\');\n  },\n\n  after : function(browser) {\n    console.log(\'Closing down...\');\n  },\n\n  beforeEach : function(browser) {\n\n  },\n\n  afterEach : function() {\n\n  },\n\n  \'step one\' : function (browser) {\n    browser\n     // ...\n  },\n\n  \'step two\' : function (browser) {\n    browser\n    // ...\n      .end();\n  }\n};\n```\n\n# 运行测试\n\n```shell\nnightwatch\n```\n\n# 总结\n\n这里我只是简单介绍一下nightwatch，更加详细具体的使用还是需要参考官方文档。有了ui自动化测试以后，我们可以简单的做一些回归测试，比如，改了某些代码以后，把所有的页面都跑一遍，看看控制台有没有报错，比点点点方便多了', '<h1><a id=\"Nightwatch_0\"></a>Nightwatch介绍</h1>\n<p>在介绍Nightwatch之前，同样有一个自动化测试的脚本语言phantomjs，这个phantomjs是一个无界面的方式实现自动化测试的，优缺点对比也很明显，当然，有一些就是用后者来实现后台爬虫的。</p>\n<table>\n<thead>\n<tr>\n<th>Nightwatch</th>\n<th>phantomjs</th>\n</tr>\n</thead>\n<tbody>\n<tr>\n<td>有界面</td>\n<td>无界面</td>\n</tr>\n<tr>\n<td>API丰富</td>\n<td>API有点不够用</td>\n</tr>\n<tr>\n<td>直接调用webDriver，兼容性好</td>\n<td>通过Selenium调用各个浏览器驱动，兼容性略差</td>\n</tr>\n</tbody>\n</table>\n<!--more-->\n<h1><a id=\"Nightwatch_15\"></a>安装Nightwatch</h1>\n<pre><code class=\"lang-shell\"># 在当前项目中安装\nnpm i -D nightwatch\n\n# 或者全局安装\nnpm i -g nightwatch\n\n</code></pre>\n<p>Nightwatch有两种方式去调起浏览器跑测试</p>\n<ol>\n<li>通过Selenium，调各个浏览器的webDriver唤起浏览器。这个需要安装java、Selenium、webDriver</li>\n<li>直接通过各家浏览器的webDriver调起对应的浏览器。</li>\n</ol>\n<p>我选择了第二种，这里就需要去安装的chrome的webDriver，有个npm包帮我们做了这个事</p>\n<pre><code class=\"lang-shell\">npm i -D chromedriver\n</code></pre>\n<p>安装的时候可能会遇到’网络问题’，在根目录下新建一个.npmrc文件,指定一下下载路径</p>\n<pre><code class=\"lang-shell\">chromedriver_cdnurl=https://npm.taobao.org/mirrors/chromedriver\n</code></pre>\n<p>或者更直接</p>\n<pre><code class=\"lang-shell\">npm install chromedriver --chromedriver_cdnurl=https://npm.taobao.org/mirrors/chromedriver\n</code></pre>\n<h1><a id=\"nightwatchjson_48\"></a>配置文件nightwatch.json</h1>\n<p>Nightwatch启动的时候默认会去加载nightwatch.json配置文件，nightwatch.js也行，这里贴上我的配置文件，并对一些常用的字段做一下说明，其余看文档就行</p>\n<pre><code class=\"lang-json\">{\n  &quot;src_folders&quot;: [&quot;test/ui&quot;],\n  &quot;output_folder&quot;: &quot;reports&quot;,\n  &quot;custom_commands_path&quot;: &quot;&quot;,\n  &quot;custom_assertions_path&quot;: &quot;&quot;,\n  &quot;page_objects_path&quot;: &quot;&quot;,\n  &quot;globals_path&quot;: &quot;./webDriver.js&quot;,\n\n  &quot;selenium&quot;: {\n    &quot;start_process&quot;: false\n  },\n\n  &quot;test_settings&quot;: {\n    &quot;default&quot;: {\n      &quot;selenium_port&quot;: 9515,\n      &quot;selenium_host&quot;: &quot;localhost&quot;,\n      &quot;default_path_prefix&quot;: &quot;&quot;,\n\n      &quot;desiredCapabilities&quot;: {\n        &quot;browserName&quot;: &quot;chrome&quot;,\n        &quot;chromeOptions&quot;: {\n          &quot;args&quot;: [\n            &quot;--no-sandbox&quot;,\n            &quot;user-data-dir=/Users/shenshuaijia/Library/Application Support/Google/Chrome&quot;\n          ]\n        },\n        &quot;acceptSslCerts&quot;: true\n      },\n      &quot;globals&quot;: {\n        &quot;domain&quot;: &quot;http://www.zealsay.com&quot;\n      }\n    }\n  }\n}\n\n</code></pre>\n<ul>\n<li>src_folders: 指定测试用例的文件夹，里面所有的js文件测试的时候都会被执行</li>\n<li>output_folder： 指定产生报告存放的路径</li>\n<li>globals_path： 全局模块路径，nightwatch启动时还会去加载这个路径下的模块，比如我们刚刚下载了Chromedriver，我们需要写个模块文件，简单包装一下暴露出来被nightwatch加载。 这是我根目录下的webDriver.js文件，这样的话，nightwatch就能通过这个文件调webdriver然后启动浏览器了</li>\n</ul>\n<pre><code class=\"lang-javascript\">const chromedriver = require(\'chromedriver\')\n\nmodule.exports = {\n  before: function(done) {\n    chromedriver.start()\n    done()\n  },\n\n  after: function(done) {\n    chromedriver.stop()\n    done()\n  }\n}\n</code></pre>\n<ul>\n<li>\n<p>selenium： selenium的配置，因为我选择了第二中安装方式，所以要禁用掉selenium</p>\n</li>\n<li>\n<p>test_settings：启动测试时的一些配置，每一个key对应一套配置，比如通过命令nightwatch --env default使用default那一套配置，也可以用nightwatch --env integration来运行integration那套配置，但需要事先在test_settings中有配置</p>\n</li>\n<li>\n<p>desiredCapabilities：这个是对Chromdriver能力配置，具体的话，就需要查看Chromdriver的文档<br />\n这里我遇到了一个比较特殊的情况，我需要使用平时使用chrome留下的cookie，而不是完全的沙盒模式，所以，我这里需要启动chromedriver的时候，指定加载chrome用户数据的文件夹&quot;user-data-dir=/Users/shenshuaijia/Library/Application Support/Google/Chrome&quot;，这样所有的登录信息都能在测试的时候被使用。</p>\n</li>\n<li>\n<p>globals： 在测试的时候，也可以定义一下全局变量，方便测试的时候使用,这里我定义了一个domain，写测试的时候可以在browser.globals.domain获取</p>\n</li>\n</ul>\n<h1><a id=\"_117\"></a>编写测试</h1>\n<p>在test/ui文件夹下新建一个测试文件page.test.js</p>\n<pre><code class=\"lang-javascript\">module.exports = {\n  \'Demo test Google\' : function (browser) {\n    browser\n      .url(\'http://www.google.com\')\n      .waitForElementVisible(\'body\', 1000)\n      .setValue(\'input[type=text]\', \'nightwatch\')\n      .waitForElementVisible(\'button[name=btnG]\', 1000)\n      .click(\'button[name=btnG]\')\n      .pause(1000)\n      .assert.containsText(\'#main\', \'Night Watch\')\n      .end();\n  }\n}\n</code></pre>\n<p>nightwatch拥有比较优雅的测试写法。这里就是简单打开一个谷歌页面，往输入框输入nightwatch然后点击按钮。记住所有的测试完成后需要调end方法来退出浏览量。nightwatch也可以定义一些钩子函数</p>\n<pre><code class=\"lang-javascript\">module.exports = {\n  before : function(browser) {\n    console.log(\'Setting up...\');\n  },\n\n  after : function(browser) {\n    console.log(\'Closing down...\');\n  },\n\n  beforeEach : function(browser) {\n\n  },\n\n  afterEach : function() {\n\n  },\n\n  \'step one\' : function (browser) {\n    browser\n     // ...\n  },\n\n  \'step two\' : function (browser) {\n    browser\n    // ...\n      .end();\n  }\n};\n</code></pre>\n<h1><a id=\"_170\"></a>运行测试</h1>\n<pre><code class=\"lang-shell\">nightwatch\n</code></pre>\n<h1><a id=\"_176\"></a>总结</h1>\n<p>这里我只是简单介绍一下nightwatch，更加详细具体的使用还是需要参考官方文档。有了ui自动化测试以后，我们可以简单的做一些回归测试，比如，改了某些代码以后，把所有的页面都跑一遍，看看控制台有没有报错，比点点点方便多了</p>\n', 'FORMAL', 'ALL', 'javascript,devops,docker', 5, 0, 1, 1, '2019-07-01 22:30:04', '2020-07-09 09:28:02', 0);
INSERT INTO `article` VALUES (1145956986698317825, '消息系统设计与实现「上篇」', 'web网站的站内消息设计与实现', 'https://pan.zealsay.com/20190702152640178000000.jpg', '# 产品分析 \n首先我们来看一下市场上关于消息的实现是怎么样的。\n### 简书\n\n简书的消息系统主要分了两种\n\n- 简信\n- 提醒\n\n##### 简信\n简信的性质其实跟私信是一样的，是用户发送给用户的一则消息，有具体的信息内容。\n\n##### 提醒\n而提醒，则是系统发送的一则消息，其文案格式是固定的，并且对特殊对象一般拥有超链接。\n[![](https://upload-images.jianshu.io/upload_images/79702-d8e9bcfcbde089ec.jpg)](https://upload-images.jianshu.io/upload_images/79702-d8e9bcfcbde089ec.jpg)\n\n### 知乎\n知乎跟简书一样，主要分了两种：\n\n- 私信\n- 消息\n\n##### 私信\n跟简书一样，使用户发送给用户的一则消息，也可以是管理员发送给用户的消息。\n\n[![](https://upload-images.jianshu.io/upload_images/79702-4c98190143481f7a.jpg)](https://upload-images.jianshu.io/upload_images/79702-4c98190143481f7a.jpg)\n\n##### 消息\n知乎的消息比简书的提醒有过之而无不及，知乎会对多条相似的消息进行聚会，以达到减轻用户阅读压力的体验。\n\n[![](https://upload-images.jianshu.io/upload_images/79702-9c189d0ea208b71d.jpg)](https://upload-images.jianshu.io/upload_images/79702-9c189d0ea208b71d.jpg)\n\n### 阿里云\n\n- 站内消息\n\n![](https://www.zealsay.com/wp-content/uploads/2018/09/ab5bb2ba54be4345dbef77045886d8f2.png)\n\n阿里云的C端用户，主要是站内消息，而这些站内消息主要是促销活动的广播信息。\n\n![](https://www.zealsay.com/wp-content/uploads/2018/09/2789349276e9e1014a46832915bf1c30.png)\n\n\n还可以加一个`label`标签来区分消息的类别。\n\n### 消息的三种分类\n通过三种产品的简单分析，得出他们的消息有两种分类，在这基础上，我们再加上一种：公告。\n公告的主要性质是系统发送一则含有具体内容的消息，站内所有用户都能读取到这条消息。\n所以，消息有三种分类：\n\n1. 公告 Announce\n2. 提醒 Remind\n3. 私信 Message\n\n### 提醒的语言分析\n\n我们从简书取一组提醒样本：\n\n- 3dbe1bd90774 关注了你\n- magicdawn 喜欢了你的文章 《单点登录的三种实现方式》\n- 无良程序 喜欢了你的文章 《基于RESTful API 怎么设计用户权限控制？》\n- alexcc4 喜欢了你的文章 《在Nodejs中贯彻单元测试》\n- 你在《基于RESTful API 怎么设计用户权限控制？》中收到一条 cnlinjie 的评论\n- 你的文章《Session原理》已被加入专题 《ios开发》\n- 分析句子结构，提醒的内容无非就是\n\n`「谁对一样属于谁的事物做了什么操作」\n「someone do something in someone\'s something」`\n\nsomeone = 提醒的触发者，或者发送者，标记为sender\ndo something = 提醒的动作，评论、喜欢、关注都属于一个动作，标记为action\nsomething = 提醒的动作作用对象，这就具体到是哪一篇文章，标记为target\nsomeone\'s = 提醒的动作作用对象的所有者，标记为targetOwner\n\n这就清楚了，sender和targetOwner就是网站的用户，而target是具体到哪一篇文章，如果提醒的对象不仅仅局限于文章，还有其他的话，就需要增加一项targetType，来标记目标是文章还是其他的什么。而action，则是固定的，整个网站会触发提醒的动作可能就只有那几样：评论、喜欢、关注.....（或者其他业务需要提醒的动作）\n\n### 消息的两种获取方式\n\n- 推 Push\n- 拉 Pull\n\n##### 以知乎为例\n推的比较常见，需要针对某一个问题维护着一张关注者的列表，每当触发这个问题推送的条件时（例如有人回答问题），就把这个通知发送给每个关注者。\n\n拉的相对麻烦一点，就是推的反向，例如每个用户都有一张关注问题的列表，每当用户上线的时候，对每个问题进行轮询，当问题的事件列表出现了比我原本时间戳大的信息就进行拉取。\n\n##### 而我们则根据消息的不同分类采用不同的获取方式：\n通告和提醒，适合使用拉取的方式，消息产生之后，会存在消息表中，用户在某一特定的时间根据自己关注问题的表进行消息的拉取，然后添加到自己的消息队列中，\n\n信息，适合使用推的方式，在发送者建立一条信息之后，同时指定接收者，把消息添加到接收者的消息队列中。\n\n### 订阅\n\n根据提醒使用拉取的方式，需要维护一个关注某一事物的列表。\n这种行为，我们称之为：**「订阅」Subscribe **\n\n##### 一则订阅有以下三个核心属性：\n\n- 订阅的目标 target\n- 订阅的目标类型 targetType\n- 订阅的动作 action\n\n比如我发布了一篇文章，那么我会订阅文章《XXX》的评论动作，所以文章《XXX》每被人评论了，就需要发送一则提醒告知我。\n\n##### 订阅的规则还可以扩展\n\n我喜欢了一篇文章，和我发布了一篇文章，订阅的动作可能不一样。\n喜欢了一篇文章，我希望我订阅这篇文章更新、评论的动作。\n而发布了一篇文章，我希望我只是订阅这篇文章的评论动作。\n\n这时候就需要多一个参数：subscribReason\n不同的subscribReason，对应着一个动作数组，\nsubscribReason = 喜欢，对应着 actions = [更新，评论]\nsubscribReason = 发布，对应着 actions = [评论]\n\n##### 订阅的规则还还可以扩展\n用户可能会有一个自己的订阅设置，比如对于所有的喜欢的动作，我都不希望接收。\n比如Knewone的提醒设置\n\n[![](https://upload-images.jianshu.io/upload_images/79702-aa831d93990cff2e.jpg)](https://upload-images.jianshu.io/upload_images/79702-aa831d93990cff2e.jpg)\n所以我们需要再维护一个表：SubscriptionConfig，来存放用户的提醒设置。\n并且，当用户没有提醒设置的时候，可以使用系统提供的一套默认设置：defaultSubscriptionConfig\n\n### 聚合\n如果我发布了一篇文章《XXX》，在我不在线的时候，被评论了10遍，当我一上线的时候，应该是收到十条信息类似于：「谁谁谁评论了你的文章《XXX》」?\n还是应该收到一条信息：「甲、乙、丙、丁...评论了你的文章《XXX》」?\n\n### 五个实体\n\n通过上面的分析，大概知道做这个消息系统，需要哪些实体类：\n\n1.  消息实体 Notify\n2. 用户消息队列 UserNotify\n3. 用户 User\n4. 订阅 Subscription\n5. 订阅设置 SubscriptionConfig\n	- 消息 Notify\n	- 通告 Announce\n	- 提醒 Remind\n	- 信息 Message\n\n### 行为分解\n\n说了这么多，整理一下整个消息流程的一些行为：\n\n- 系统或者管理员，创建消息\n createNotify (make announce | remind | message)\n- 用户，订阅消息，取消订阅\nsubscribe, cancelSubscription\n- 用户管理订阅设置\ngetSubscriptionConfig, updateSubscriptionConfig\n- 用户，拉取消息\npullNotify (pull announce | remind | message | all)\n- 用户，查询消息队列\ngetUserNotify(get announce | remind | message | all)\n- 用户阅读消息\nread\n\n', '<h1><a id=\"_0\"></a>产品分析</h1>\n<p>首先我们来看一下市场上关于消息的实现是怎么样的。</p>\n<h3><a id=\"_2\"></a>简书</h3>\n<p>简书的消息系统主要分了两种</p>\n<ul>\n<li>简信</li>\n<li>提醒</li>\n</ul>\n<h5><a id=\"_9\"></a>简信</h5>\n<p>简信的性质其实跟私信是一样的，是用户发送给用户的一则消息，有具体的信息内容。</p>\n<h5><a id=\"_12\"></a>提醒</h5>\n<p>而提醒，则是系统发送的一则消息，其文案格式是固定的，并且对特殊对象一般拥有超链接。<br />\n<a href=\"https://upload-images.jianshu.io/upload_images/79702-d8e9bcfcbde089ec.jpg\" target=\"_blank\"><img src=\"https://upload-images.jianshu.io/upload_images/79702-d8e9bcfcbde089ec.jpg\" alt=\"\" /></a></p>\n<h3><a id=\"_16\"></a>知乎</h3>\n<p>知乎跟简书一样，主要分了两种：</p>\n<ul>\n<li>私信</li>\n<li>消息</li>\n</ul>\n<h5><a id=\"_22\"></a>私信</h5>\n<p>跟简书一样，使用户发送给用户的一则消息，也可以是管理员发送给用户的消息。</p>\n<p><a href=\"https://upload-images.jianshu.io/upload_images/79702-4c98190143481f7a.jpg\" target=\"_blank\"><img src=\"https://upload-images.jianshu.io/upload_images/79702-4c98190143481f7a.jpg\" alt=\"\" /></a></p>\n<h5><a id=\"_27\"></a>消息</h5>\n<p>知乎的消息比简书的提醒有过之而无不及，知乎会对多条相似的消息进行聚会，以达到减轻用户阅读压力的体验。</p>\n<p><a href=\"https://upload-images.jianshu.io/upload_images/79702-9c189d0ea208b71d.jpg\" target=\"_blank\"><img src=\"https://upload-images.jianshu.io/upload_images/79702-9c189d0ea208b71d.jpg\" alt=\"\" /></a></p>\n<h3><a id=\"_32\"></a>阿里云</h3>\n<ul>\n<li>站内消息</li>\n</ul>\n<p><img src=\"https://www.zealsay.com/wp-content/uploads/2018/09/ab5bb2ba54be4345dbef77045886d8f2.png\" alt=\"\" /></p>\n<p>阿里云的C端用户，主要是站内消息，而这些站内消息主要是促销活动的广播信息。</p>\n<p><img src=\"https://www.zealsay.com/wp-content/uploads/2018/09/2789349276e9e1014a46832915bf1c30.png\" alt=\"\" /></p>\n<p>还可以加一个<code>label</code>标签来区分消息的类别。</p>\n<h3><a id=\"_45\"></a>消息的三种分类</h3>\n<p>通过三种产品的简单分析，得出他们的消息有两种分类，在这基础上，我们再加上一种：公告。<br />\n公告的主要性质是系统发送一则含有具体内容的消息，站内所有用户都能读取到这条消息。<br />\n所以，消息有三种分类：</p>\n<ol>\n<li>公告 Announce</li>\n<li>提醒 Remind</li>\n<li>私信 Message</li>\n</ol>\n<h3><a id=\"_54\"></a>提醒的语言分析</h3>\n<p>我们从简书取一组提醒样本：</p>\n<ul>\n<li>3dbe1bd90774 关注了你</li>\n<li>magicdawn 喜欢了你的文章 《单点登录的三种实现方式》</li>\n<li>无良程序 喜欢了你的文章 《基于RESTful API 怎么设计用户权限控制？》</li>\n<li>alexcc4 喜欢了你的文章 《在Nodejs中贯彻单元测试》</li>\n<li>你在《基于RESTful API 怎么设计用户权限控制？》中收到一条 cnlinjie 的评论</li>\n<li>你的文章《Session原理》已被加入专题 《ios开发》</li>\n<li>分析句子结构，提醒的内容无非就是</li>\n</ul>\n<p><code>「谁对一样属于谁的事物做了什么操作」 「someone do something in someone\'s something」</code></p>\n<p>someone = 提醒的触发者，或者发送者，标记为sender<br />\ndo something = 提醒的动作，评论、喜欢、关注都属于一个动作，标记为action<br />\nsomething = 提醒的动作作用对象，这就具体到是哪一篇文章，标记为target<br />\nsomeone’s = 提醒的动作作用对象的所有者，标记为targetOwner</p>\n<p>这就清楚了，sender和targetOwner就是网站的用户，而target是具体到哪一篇文章，如果提醒的对象不仅仅局限于文章，还有其他的话，就需要增加一项targetType，来标记目标是文章还是其他的什么。而action，则是固定的，整个网站会触发提醒的动作可能就只有那几样：评论、喜欢、关注…（或者其他业务需要提醒的动作）</p>\n<h3><a id=\"_76\"></a>消息的两种获取方式</h3>\n<ul>\n<li>推 Push</li>\n<li>拉 Pull</li>\n</ul>\n<h5><a id=\"_81\"></a>以知乎为例</h5>\n<p>推的比较常见，需要针对某一个问题维护着一张关注者的列表，每当触发这个问题推送的条件时（例如有人回答问题），就把这个通知发送给每个关注者。</p>\n<p>拉的相对麻烦一点，就是推的反向，例如每个用户都有一张关注问题的列表，每当用户上线的时候，对每个问题进行轮询，当问题的事件列表出现了比我原本时间戳大的信息就进行拉取。</p>\n<h5><a id=\"_86\"></a>而我们则根据消息的不同分类采用不同的获取方式：</h5>\n<p>通告和提醒，适合使用拉取的方式，消息产生之后，会存在消息表中，用户在某一特定的时间根据自己关注问题的表进行消息的拉取，然后添加到自己的消息队列中，</p>\n<p>信息，适合使用推的方式，在发送者建立一条信息之后，同时指定接收者，把消息添加到接收者的消息队列中。</p>\n<h3><a id=\"_91\"></a>订阅</h3>\n<p>根据提醒使用拉取的方式，需要维护一个关注某一事物的列表。<br />\n这种行为，我们称之为：**「订阅」Subscribe **</p>\n<h5><a id=\"_96\"></a>一则订阅有以下三个核心属性：</h5>\n<ul>\n<li>订阅的目标 target</li>\n<li>订阅的目标类型 targetType</li>\n<li>订阅的动作 action</li>\n</ul>\n<p>比如我发布了一篇文章，那么我会订阅文章《XXX》的评论动作，所以文章《XXX》每被人评论了，就需要发送一则提醒告知我。</p>\n<h5><a id=\"_104\"></a>订阅的规则还可以扩展</h5>\n<p>我喜欢了一篇文章，和我发布了一篇文章，订阅的动作可能不一样。<br />\n喜欢了一篇文章，我希望我订阅这篇文章更新、评论的动作。<br />\n而发布了一篇文章，我希望我只是订阅这篇文章的评论动作。</p>\n<p>这时候就需要多一个参数：subscribReason<br />\n不同的subscribReason，对应着一个动作数组，<br />\nsubscribReason = 喜欢，对应着 actions = [更新，评论]<br />\nsubscribReason = 发布，对应着 actions = [评论]</p>\n<h5><a id=\"_115\"></a>订阅的规则还还可以扩展</h5>\n<p>用户可能会有一个自己的订阅设置，比如对于所有的喜欢的动作，我都不希望接收。<br />\n比如Knewone的提醒设置</p>\n<p><a href=\"https://upload-images.jianshu.io/upload_images/79702-aa831d93990cff2e.jpg\" target=\"_blank\"><img src=\"https://upload-images.jianshu.io/upload_images/79702-aa831d93990cff2e.jpg\" alt=\"\" /></a><br />\n所以我们需要再维护一个表：SubscriptionConfig，来存放用户的提醒设置。<br />\n并且，当用户没有提醒设置的时候，可以使用系统提供的一套默认设置：defaultSubscriptionConfig</p>\n<h3><a id=\"_123\"></a>聚合</h3>\n<p>如果我发布了一篇文章《XXX》，在我不在线的时候，被评论了10遍，当我一上线的时候，应该是收到十条信息类似于：「谁谁谁评论了你的文章《XXX》」?<br />\n还是应该收到一条信息：「甲、乙、丙、丁…评论了你的文章《XXX》」?</p>\n<h3><a id=\"_127\"></a>五个实体</h3>\n<p>通过上面的分析，大概知道做这个消息系统，需要哪些实体类：</p>\n<ol>\n<li>消息实体 Notify</li>\n<li>用户消息队列 UserNotify</li>\n<li>用户 User</li>\n<li>订阅 Subscription</li>\n<li>订阅设置 SubscriptionConfig\n<ul>\n<li>消息 Notify</li>\n<li>通告 Announce</li>\n<li>提醒 Remind</li>\n<li>信息 Message</li>\n</ul>\n</li>\n</ol>\n<h3><a id=\"_141\"></a>行为分解</h3>\n<p>说了这么多，整理一下整个消息流程的一些行为：</p>\n<ul>\n<li>系统或者管理员，创建消息<br />\ncreateNotify (make announce | remind | message)</li>\n<li>用户，订阅消息，取消订阅<br />\nsubscribe, cancelSubscription</li>\n<li>用户管理订阅设置<br />\ngetSubscriptionConfig, updateSubscriptionConfig</li>\n<li>用户，拉取消息<br />\npullNotify (pull announce | remind | message | all)</li>\n<li>用户，查询消息队列<br />\ngetUserNotify(get announce | remind | message | all)</li>\n<li>用户阅读消息<br />\nread</li>\n</ul>\n', 'FORMAL', 'ALL', 'windows', 18, 0, 1, 1, '2019-07-02 15:26:51', '2019-07-06 11:45:20', 0);
INSERT INTO `article` VALUES (1145957670474727426, '消息系统设计与实现「下篇」', 'web站内消息设计与实现', 'https://pan.zealsay.com/20190702152918983000000.jpg', '# 模型设计\n### Notify\n\n```java\nid          : {type: \'integer\', primaryKey: true},      // 主键\ncontent     : {type: \'text\'},   // 消息的内容\ntype        : {type: \'integer\', required: true, enum: [1, 2, 3]},  // 消息的类型，1: 公告 Announce，2: 提醒 Remind，3：信息 Message\ntarget      : {type: \'integer\'},    // 目标的ID\ntargetType  : {type: \'string\'},    // 目标的类型\naction      : {type: \'string\'},    // 提醒信息的动作类型\nsender      : {type: \'integer\'},    // 发送者的ID\ncreatedAt   : {type: \'datetime\', required: true}\n\n```\n##### Save Remind\n消息表，我们需要`target`、`targetType`字段，来记录该条提醒所关联的对象。而`action`字段，则记录该条提醒所关联的动作。\n比如消息：「小明喜欢了文章」\n则：\n```java\ntarget = 123,  // 文章ID\ntargetType = \'post\',  // 指明target所属类型是文章\nsender = 123456  // 小明ID\n```\n##### Save Announce and Message\n当然，Notify还支持存储公告和信息。它们会用到`content`字段，而不会用到`target`、`targetType`、`action`字段。\n##### UserNotify\n```java\nid          : {type: \'integer\', primaryKey: true},      // 主键\nisRead      : {type: \'boolean\', required: true},   \nuser        : {type: \'integer\', required: true},  // 用户消息所属者\nnotify      : {type: \'integer\', required: true}   // 关联的Notify\ncreatedAt   : {type: \'datetime\', required: true}\n\n```\n我们用UserNotify来存储用户的消息队列，它关联一则提醒(Notify)的具体内容。\nUserNotify的创建，主要通过两个途径：\n\n1. 遍历订阅(Subscription)表拉取公告(Announce)和提醒(Remind)的时候创建\n2. 新建信息(Message)之后，立刻创建。\n\n##### Subscription\n```java\ntarget      : {type: \'integer\', required: true},    // 目标的ID\ntargetType  : {type: \'string\', required: true},    // 目标的类型\naction      : {type: \'string\'},   // 订阅动作,如: comment/like/post/update etc.\nuser        : {type: \'integer\'}，\ncreatedAt   : {type: \'datetime\', required: true}\n\n```\n\n订阅，是从Notify表拉取消息到UserNotify的前提，用户首先订阅了某一个目标的某一个动作，在此之后产生这个目标的这个动作的消息，才会被通知到该用户。\n如：「小明关注了产品A的评论」，数据表现为：\n\n```java\ntarget: 123,  // 产品A的ID\ntargetType: \'product\',\naction: \'comment\',\nuser: 123  // 小明的ID\n```\n这样，产品A下产生的每一条评论，都会产生通知给小明了。\n\n##### SubscriptionConfig\n```java\naction: {type: \'json\', required: true},   // 用户的设置\nuser: {type: \'integer\'}\n```\n不同用户可能会有不一样的订阅习惯，在这个表中，用户可以统一针对某种动作进行是否订阅的设置。而默认是使用系统提供的默认配置：\n```java\ndefaultSubscriptionConfig: {\n  \'comment\'   : true,    // 评论\n  \'like\'      : true,    // 喜欢\n}\n```\n在这套模型中，`targetType`、`action`是可以根据需求来扩展的，例如我们还可以增加多几个动作的提醒：`hate`被踩、`update`被更新....诸如此类。\n##### 配置文件 NotifyConfig\n```java\n// 提醒关联的目标类型\ntargetType: {\n  PRODUCT : \'product\',    // 产品\n  POST    : \'post\'    // 文章\n},\n\n// 提醒关联的动作\naction: {\n  COMMENT   : \'comment\',  // 评论\n  LIKE      : \'like\',     // 喜欢\n},\n\n// 订阅原因对应订阅事件\nreasonAction: {\n  \'create_product\'  : [\'comment\', \'like\']\n  \'like_product\'    : [\'comment\'],\n  \'like_post\'       : [\'comment\'],\n},\n\n// 默认订阅配置\ndefaultSubscriptionConfig: {\n  \'comment\'   : true,    // 评论\n  \'like\'      : true,    // 喜欢\n}\n\n```\n\n### 服务层 NotifyService\n\n##### NotifyService拥有以下方法:\n\n- createAnnounce(content, sender)\n- createRemind(target, targetType, action, sender, content)\n- createMessage(content, sender, receiver)\n- pullAnnounce(user)\n- pullRemind(user)\n- subscribe(user, target, targetType, reason)\n- cancelSubscription(user, target ,targetType)\n- getSubscriptionConfig(userID)\n- updateSubscriptionConfig(userID)\n- getUserNotify(userID)\n- read(user, notifyIDs)\n\n##### 各方法的处理逻辑如下：\n###### createAnnounce(content, sender)\n往Notify表中插入一条公告记录\n###### createRemind(target, targetType, action, sender, content)\n往Notify表中插入一条提醒记录\n###### createMessage(content, sender, receiver)\n1. 往Notify表中插入一条信息记录\n2. 往UserNotify表中插入一条记录，并关联新建的Notify\n\n###### pullAnnounce(user)\n1. 从UserNotify中获取最近的一条公告信息的创建时间: `lastTime`\n2. 用`lastTime`作为过滤条件，查询Notify的公告信息\n3. 新建UserNotify并关联查询出来的公告信息\n\n###### pullRemind(user)\n1. 查询用户的订阅表，得到用户的一系列订阅记录\n2. 通过每一条的订阅记录的`target`、`targetType`、`action`、`createdAt`去查询Notify表，获取订阅的Notify记录。（注意订阅时间必须早于提醒创建时间）\n3. 查询用户的配置文件SubscriptionConfig，如果没有则使用默认的配置DefaultSubscriptionConfig\n4. 使用订阅配置，过滤查询出来的Notify\n5. 使用过滤好的Notify作为关联新建UserNotify\n\n###### subscribe(user, target, targetType, reason)\n1. 通过`reason`，查询NotifyConfig，获取对应的动作组:`actions`\n2. 遍历动作组，每一个动作新建一则Subscription记录\n\n###### cancelSubscription(user, target ,targetType)\n\n删除`user`、`target`、`targetType`对应的一则或多则记录\n\n###### getSubscriptionConfig(userID)\n查询SubscriptionConfig表，获取用户的订阅配置\n\n###### updateSubscriptionConfig(userID)\n更新用户的SubscriptionConfig记录\n\n###### getUserNotify(userID)\n获取用户的消息列表\n\n###### read(user, notifyIDs)\n更新指定的notify，把isRead属性设置为true\n\n# 时序图\n### 提醒的订阅、创建、拉取\n![7970261d218212571d556.jpg](https://pan.zealsay.com/20190706164023128000000.jpg)\n\n我们可以在产品创建之后，调用`NotifyService.subscribe`方法，\n然后在产品被评论之后调用`NotifyService.createRemind`方法，\n再就是用户登录系统或者其他的某一个时刻调用`NotifyService.pullRemind`方法，\n最后在用户查询消息队列的时候调用`NotifyService.getUserNotify`方法。\n\n### 公告的创建、拉取\n![79702122a2d09bd4ef238.jpg](https://pan.zealsay.com/20190706164023599000000.jpg)\n\n在管理员发送了一则公告的时候，调用`NotifyService.createAnnounce`方法，\n然后在用户登录系统或者其他的某一个时刻调用`NotifyService.pullAnnounce`方法，\n最后在用户查询消息队列的时候调用`NotifyService.getUserNotify`方法。\n\n### 信息的创建\n![79702859cd50888877d67.jpg](https://pan.zealsay.com/20190706164023661000000.jpg)\n信息的创建，只需要直接调用`NotifyService.createMessage`方法就可以了，\n在下一次用户查询消息队列的时候，就会查询这条信息。', '<h1><a id=\"_0\"></a>模型设计</h1>\n<h3><a id=\"Notify_1\"></a>Notify</h3>\n<pre><div class=\"hljs\"><code class=\"lang-java\">id          : {type: <span class=\"hljs-string\">\'integer\'</span>, primaryKey: <span class=\"hljs-keyword\">true</span>},      <span class=\"hljs-comment\">// 主键</span>\ncontent     : {type: <span class=\"hljs-string\">\'text\'</span>},   <span class=\"hljs-comment\">// 消息的内容</span>\ntype        : {type: <span class=\"hljs-string\">\'integer\'</span>, required: <span class=\"hljs-keyword\">true</span>, <span class=\"hljs-keyword\">enum</span>: [<span class=\"hljs-number\">1</span>, <span class=\"hljs-number\">2</span>, <span class=\"hljs-number\">3</span>]},  <span class=\"hljs-comment\">// 消息的类型，1: 公告 Announce，2: 提醒 Remind，3：信息 Message</span>\ntarget      : {type: <span class=\"hljs-string\">\'integer\'</span>},    <span class=\"hljs-comment\">// 目标的ID</span>\ntargetType  : {type: <span class=\"hljs-string\">\'string\'</span>},    <span class=\"hljs-comment\">// 目标的类型</span>\naction      : {type: <span class=\"hljs-string\">\'string\'</span>},    <span class=\"hljs-comment\">// 提醒信息的动作类型</span>\nsender      : {type: <span class=\"hljs-string\">\'integer\'</span>},    <span class=\"hljs-comment\">// 发送者的ID</span>\ncreatedAt   : {type: <span class=\"hljs-string\">\'datetime\'</span>, required: <span class=\"hljs-keyword\">true</span>}\n\n</code></div></pre>\n<h5><a id=\"Save_Remind_14\"></a>Save Remind</h5>\n<p>消息表，我们需要<code>target</code>、<code>targetType</code>字段，来记录该条提醒所关联的对象。而<code>action</code>字段，则记录该条提醒所关联的动作。<br />\n比如消息：「小明喜欢了文章」<br />\n则：</p>\n<pre><div class=\"hljs\"><code class=\"lang-java\">target = <span class=\"hljs-number\">123</span>,  <span class=\"hljs-comment\">// 文章ID</span>\ntargetType = <span class=\"hljs-string\">\'post\'</span>,  <span class=\"hljs-comment\">// 指明target所属类型是文章</span>\nsender = <span class=\"hljs-number\">123456</span>  <span class=\"hljs-comment\">// 小明ID</span>\n</code></div></pre>\n<h5><a id=\"Save_Announce_and_Message_23\"></a>Save Announce and Message</h5>\n<p>当然，Notify还支持存储公告和信息。它们会用到<code>content</code>字段，而不会用到<code>target</code>、<code>targetType</code>、<code>action</code>字段。</p>\n<h5><a id=\"UserNotify_25\"></a>UserNotify</h5>\n<pre><div class=\"hljs\"><code class=\"lang-java\">id          : {type: <span class=\"hljs-string\">\'integer\'</span>, primaryKey: <span class=\"hljs-keyword\">true</span>},      <span class=\"hljs-comment\">// 主键</span>\nisRead      : {type: <span class=\"hljs-string\">\'boolean\'</span>, required: <span class=\"hljs-keyword\">true</span>},   \nuser        : {type: <span class=\"hljs-string\">\'integer\'</span>, required: <span class=\"hljs-keyword\">true</span>},  <span class=\"hljs-comment\">// 用户消息所属者</span>\nnotify      : {type: <span class=\"hljs-string\">\'integer\'</span>, required: <span class=\"hljs-keyword\">true</span>}   <span class=\"hljs-comment\">// 关联的Notify</span>\ncreatedAt   : {type: <span class=\"hljs-string\">\'datetime\'</span>, required: <span class=\"hljs-keyword\">true</span>}\n\n</code></div></pre>\n<p>我们用UserNotify来存储用户的消息队列，它关联一则提醒(Notify)的具体内容。<br />\nUserNotify的创建，主要通过两个途径：</p>\n<ol>\n<li>遍历订阅(Subscription)表拉取公告(Announce)和提醒(Remind)的时候创建</li>\n<li>新建信息(Message)之后，立刻创建。</li>\n</ol>\n<h5><a id=\"Subscription_40\"></a>Subscription</h5>\n<pre><div class=\"hljs\"><code class=\"lang-java\">target      : {type: <span class=\"hljs-string\">\'integer\'</span>, required: <span class=\"hljs-keyword\">true</span>},    <span class=\"hljs-comment\">// 目标的ID</span>\ntargetType  : {type: <span class=\"hljs-string\">\'string\'</span>, required: <span class=\"hljs-keyword\">true</span>},    <span class=\"hljs-comment\">// 目标的类型</span>\naction      : {type: <span class=\"hljs-string\">\'string\'</span>},   <span class=\"hljs-comment\">// 订阅动作,如: comment/like/post/update etc.</span>\nuser        : {type: <span class=\"hljs-string\">\'integer\'</span>}，\ncreatedAt   : {type: <span class=\"hljs-string\">\'datetime\'</span>, required: <span class=\"hljs-keyword\">true</span>}\n\n</code></div></pre>\n<p>订阅，是从Notify表拉取消息到UserNotify的前提，用户首先订阅了某一个目标的某一个动作，在此之后产生这个目标的这个动作的消息，才会被通知到该用户。<br />\n如：「小明关注了产品A的评论」，数据表现为：</p>\n<pre><div class=\"hljs\"><code class=\"lang-java\">target: <span class=\"hljs-number\">123</span>,  <span class=\"hljs-comment\">// 产品A的ID</span>\ntargetType: <span class=\"hljs-string\">\'product\'</span>,\naction: <span class=\"hljs-string\">\'comment\'</span>,\nuser: <span class=\"hljs-number\">123</span>  <span class=\"hljs-comment\">// 小明的ID</span>\n</code></div></pre>\n<p>这样，产品A下产生的每一条评论，都会产生通知给小明了。</p>\n<h5><a id=\"SubscriptionConfig_61\"></a>SubscriptionConfig</h5>\n<pre><div class=\"hljs\"><code class=\"lang-java\">action: {type: <span class=\"hljs-string\">\'json\'</span>, required: <span class=\"hljs-keyword\">true</span>},   <span class=\"hljs-comment\">// 用户的设置</span>\nuser: {type: <span class=\"hljs-string\">\'integer\'</span>}\n</code></div></pre>\n<p>不同用户可能会有不一样的订阅习惯，在这个表中，用户可以统一针对某种动作进行是否订阅的设置。而默认是使用系统提供的默认配置：</p>\n<pre><div class=\"hljs\"><code class=\"lang-java\">defaultSubscriptionConfig: {\n  <span class=\"hljs-string\">\'comment\'</span>   : <span class=\"hljs-keyword\">true</span>,    <span class=\"hljs-comment\">// 评论</span>\n  <span class=\"hljs-string\">\'like\'</span>      : <span class=\"hljs-keyword\">true</span>,    <span class=\"hljs-comment\">// 喜欢</span>\n}\n</code></div></pre>\n<p>在这套模型中，<code>targetType</code>、<code>action</code>是可以根据需求来扩展的，例如我们还可以增加多几个动作的提醒：<code>hate</code>被踩、<code>update</code>被更新…诸如此类。</p>\n<h5><a id=\"_NotifyConfig_74\"></a>配置文件 NotifyConfig</h5>\n<pre><div class=\"hljs\"><code class=\"lang-java\"><span class=\"hljs-comment\">// 提醒关联的目标类型</span>\ntargetType: {\n  PRODUCT : <span class=\"hljs-string\">\'product\'</span>,    <span class=\"hljs-comment\">// 产品</span>\n  POST    : <span class=\"hljs-string\">\'post\'</span>    <span class=\"hljs-comment\">// 文章</span>\n},\n\n<span class=\"hljs-comment\">// 提醒关联的动作</span>\naction: {\n  COMMENT   : <span class=\"hljs-string\">\'comment\'</span>,  <span class=\"hljs-comment\">// 评论</span>\n  LIKE      : <span class=\"hljs-string\">\'like\'</span>,     <span class=\"hljs-comment\">// 喜欢</span>\n},\n\n<span class=\"hljs-comment\">// 订阅原因对应订阅事件</span>\nreasonAction: {\n  <span class=\"hljs-string\">\'create_product\'</span>  : [<span class=\"hljs-string\">\'comment\'</span>, <span class=\"hljs-string\">\'like\'</span>]\n  <span class=\"hljs-string\">\'like_product\'</span>    : [<span class=\"hljs-string\">\'comment\'</span>],\n  <span class=\"hljs-string\">\'like_post\'</span>       : [<span class=\"hljs-string\">\'comment\'</span>],\n},\n\n<span class=\"hljs-comment\">// 默认订阅配置</span>\ndefaultSubscriptionConfig: {\n  <span class=\"hljs-string\">\'comment\'</span>   : <span class=\"hljs-keyword\">true</span>,    <span class=\"hljs-comment\">// 评论</span>\n  <span class=\"hljs-string\">\'like\'</span>      : <span class=\"hljs-keyword\">true</span>,    <span class=\"hljs-comment\">// 喜欢</span>\n}\n\n</code></div></pre>\n<h3><a id=\"_NotifyService_103\"></a>服务层 NotifyService</h3>\n<h5><a id=\"NotifyService_105\"></a>NotifyService拥有以下方法:</h5>\n<ul>\n<li>createAnnounce(content, sender)</li>\n<li>createRemind(target, targetType, action, sender, content)</li>\n<li>createMessage(content, sender, receiver)</li>\n<li>pullAnnounce(user)</li>\n<li>pullRemind(user)</li>\n<li>subscribe(user, target, targetType, reason)</li>\n<li>cancelSubscription(user, target ,targetType)</li>\n<li>getSubscriptionConfig(userID)</li>\n<li>updateSubscriptionConfig(userID)</li>\n<li>getUserNotify(userID)</li>\n<li>read(user, notifyIDs)</li>\n</ul>\n<h5><a id=\"_119\"></a>各方法的处理逻辑如下：</h5>\n<h6><a id=\"createAnnouncecontent_sender_120\"></a>createAnnounce(content, sender)</h6>\n<p>往Notify表中插入一条公告记录</p>\n<h6><a id=\"createRemindtarget_targetType_action_sender_content_122\"></a>createRemind(target, targetType, action, sender, content)</h6>\n<p>往Notify表中插入一条提醒记录</p>\n<h6><a id=\"createMessagecontent_sender_receiver_124\"></a>createMessage(content, sender, receiver)</h6>\n<ol>\n<li>往Notify表中插入一条信息记录</li>\n<li>往UserNotify表中插入一条记录，并关联新建的Notify</li>\n</ol>\n<h6><a id=\"pullAnnounceuser_128\"></a>pullAnnounce(user)</h6>\n<ol>\n<li>从UserNotify中获取最近的一条公告信息的创建时间: <code>lastTime</code></li>\n<li>用<code>lastTime</code>作为过滤条件，查询Notify的公告信息</li>\n<li>新建UserNotify并关联查询出来的公告信息</li>\n</ol>\n<h6><a id=\"pullReminduser_133\"></a>pullRemind(user)</h6>\n<ol>\n<li>查询用户的订阅表，得到用户的一系列订阅记录</li>\n<li>通过每一条的订阅记录的<code>target</code>、<code>targetType</code>、<code>action</code>、<code>createdAt</code>去查询Notify表，获取订阅的Notify记录。（注意订阅时间必须早于提醒创建时间）</li>\n<li>查询用户的配置文件SubscriptionConfig，如果没有则使用默认的配置DefaultSubscriptionConfig</li>\n<li>使用订阅配置，过滤查询出来的Notify</li>\n<li>使用过滤好的Notify作为关联新建UserNotify</li>\n</ol>\n<h6><a id=\"subscribeuser_target_targetType_reason_140\"></a>subscribe(user, target, targetType, reason)</h6>\n<ol>\n<li>通过<code>reason</code>，查询NotifyConfig，获取对应的动作组:<code>actions</code></li>\n<li>遍历动作组，每一个动作新建一则Subscription记录</li>\n</ol>\n<h6><a id=\"cancelSubscriptionuser_target_targetType_144\"></a>cancelSubscription(user, target ,targetType)</h6>\n<p>删除<code>user</code>、<code>target</code>、<code>targetType</code>对应的一则或多则记录</p>\n<h6><a id=\"getSubscriptionConfiguserID_148\"></a>getSubscriptionConfig(userID)</h6>\n<p>查询SubscriptionConfig表，获取用户的订阅配置</p>\n<h6><a id=\"updateSubscriptionConfiguserID_151\"></a>updateSubscriptionConfig(userID)</h6>\n<p>更新用户的SubscriptionConfig记录</p>\n<h6><a id=\"getUserNotifyuserID_154\"></a>getUserNotify(userID)</h6>\n<p>获取用户的消息列表</p>\n<h6><a id=\"readuser_notifyIDs_157\"></a>read(user, notifyIDs)</h6>\n<p>更新指定的notify，把isRead属性设置为true</p>\n<h1><a id=\"_160\"></a>时序图</h1>\n<h3><a id=\"_161\"></a>提醒的订阅、创建、拉取</h3>\n<p><img src=\"https://pan.zealsay.com/20190706164023128000000.jpg\" alt=\"7970261d218212571d556.jpg\" /></p>\n<p>我们可以在产品创建之后，调用<code>NotifyService.subscribe</code>方法，<br />\n然后在产品被评论之后调用<code>NotifyService.createRemind</code>方法，<br />\n再就是用户登录系统或者其他的某一个时刻调用<code>NotifyService.pullRemind</code>方法，<br />\n最后在用户查询消息队列的时候调用<code>NotifyService.getUserNotify</code>方法。</p>\n<h3><a id=\"_169\"></a>公告的创建、拉取</h3>\n<p><img src=\"https://pan.zealsay.com/20190706164023599000000.jpg\" alt=\"79702122a2d09bd4ef238.jpg\" /></p>\n<p>在管理员发送了一则公告的时候，调用<code>NotifyService.createAnnounce</code>方法，<br />\n然后在用户登录系统或者其他的某一个时刻调用<code>NotifyService.pullAnnounce</code>方法，<br />\n最后在用户查询消息队列的时候调用<code>NotifyService.getUserNotify</code>方法。</p>\n<h3><a id=\"_176\"></a>信息的创建</h3>\n<p><img src=\"https://pan.zealsay.com/20190706164023661000000.jpg\" alt=\"79702859cd50888877d67.jpg\" /><br />\n信息的创建，只需要直接调用<code>NotifyService.createMessage</code>方法就可以了，<br />\n在下一次用户查询消息队列的时候，就会查询这条信息。</p>\n', 'FORMAL', 'ALL', 'windows', 41, 0, 1, 1, '2019-07-02 15:29:34', '2019-07-06 16:40:24', 0);
INSERT INTO `article` VALUES (1145958275343695873, '解决Mac下ls,ll等命令不合法问题', '解决Mac下ls,ll等命令不合法问题', 'https://pan.zealsay.com/20190702153141509000000.jpg', '今天打开电脑，习惯性的打开终端，不料却发现 \n```shell\nls  或者 ls -l\n```\n都无法使用，报如下错误：\n```shell\nls: illegal option -- -\nusage: ls [-ABCFGHLOPRSTUWabcdefghiklmnopqrstuwx1] [file ...]\n```\n查看后发现是由于命令行文件的\n\n```shell\n -color=auto\n```\n造成的，因此修改了一下 .bashrc文件。\n\n```shell\nsudo vim ~/.bashrc\n```\n我修改成如下所示：\n\n![](https://www.zealsay.com/wp-content/uploads/2018/08/fb7908de92c07517545a448d27b1cf58.png)\n\n然后保存一下，让配置生效。\n```shell\nsudo source ~/.bashrc\n```\n测试下，发现ok了，这样就可以使用ls命令了。\n\n![](https://www.zealsay.com/wp-content/uploads/2018/08/5b4405b3ec42b138f0cfcf9a48393c02.png)', '<p>今天打开电脑，习惯性的打开终端，不料却发现</p>\n<pre><div class=\"hljs\"><code class=\"lang-shell\">ls  或者 ls -l\n</code></div></pre>\n<p>都无法使用，报如下错误：</p>\n<pre><div class=\"hljs\"><code class=\"lang-shell\">ls: illegal option -- -\nusage: ls [-ABCFGHLOPRSTUWabcdefghiklmnopqrstuwx1] [file ...]\n</code></div></pre>\n<p>查看后发现是由于命令行文件的</p>\n<pre><div class=\"hljs\"><code class=\"lang-shell\"> -color=auto\n</code></div></pre>\n<p>造成的，因此修改了一下 .bashrc文件。</p>\n<pre><div class=\"hljs\"><code class=\"lang-shell\">sudo vim ~/.bashrc\n</code></div></pre>\n<p>我修改成如下所示：</p>\n<p><img src=\"https://www.zealsay.com/wp-content/uploads/2018/08/fb7908de92c07517545a448d27b1cf58.png\" alt=\"\" /></p>\n<p>然后保存一下，让配置生效。</p>\n<pre><div class=\"hljs\"><code class=\"lang-shell\">sudo source ~/.bashrc\n</code></div></pre>\n<p>测试下，发现ok了，这样就可以使用ls命令了。</p>\n<p><img src=\"https://www.zealsay.com/wp-content/uploads/2018/08/5b4405b3ec42b138f0cfcf9a48393c02.png\" alt=\"\" /></p>\n', 'DRAFT', 'ALL', '津津原味,ios', 2, 0, 1, 1, '2019-07-02 15:31:58', '2019-07-03 18:50:09', 0);
INSERT INTO `article` VALUES (1145991328820584449, 'Debain 8环境安装git', '在linux系统Debain 8环境安装git', 'https://pan.zealsay.com/20190702174254549000000.jpg', '## 前言\n   git是一个开源的分布式版本管理系统，可以有效、高速的处理从很小到非常大的项目版本管理。\n   目前很多的企业都是使用git来管理代码，Git的本身对分布式支持的优势，使得在微服务遍地开花的今天更加耀眼，是团队进行分布式开发合作的不二之选。至于更多的优点我就不在这里一一累赘了，这里主要将如何在debain 8上面搭建git环境。\n##    安装\ngit的安装也十分简单，对于debian，使用apt安装是最为快速的。\n### 更新apt源\n```shell\nsudo apt-get update\n```\n### 安装git\n```shell\nsudo apt-get install git-core\n```\n## 配置\n安装完之后，接下来就可以配置git了。\n首先可以检查是否安装成功\n执行\n```shell\ngit --version\n```\n如果看到如下，就说明安装成功。\n![](https://www.zealsay.com/wp-content/uploads/2018/06/5f9ae0d809b74b68fdd59e87ab5ed1d0.png)\n### 设置用户名\n```shell\ngit config --global user.name \"Tom\"\n```\n### 设置你的电子邮件\n```shell\n\ngit config --global user.email tom@example.com\n```\n\n到此为止，你的git环境已经搭建起来了，可以使用`git clone` 来克隆一个项目。\n\n', '<h2><a id=\"_0\"></a>前言</h2>\n<p>git是一个开源的分布式版本管理系统，可以有效、高速的处理从很小到非常大的项目版本管理。<br />\n目前很多的企业都是使用git来管理代码，Git的本身对分布式支持的优势，使得在微服务遍地开花的今天更加耀眼，是团队进行分布式开发合作的不二之选。至于更多的优点我就不在这里一一累赘了，这里主要将如何在debain 8上面搭建git环境。</p>\n<h2><a id=\"_3\"></a>安装</h2>\n<p>git的安装也十分简单，对于debian，使用apt安装是最为快速的。</p>\n<h3><a id=\"apt_5\"></a>更新apt源</h3>\n<pre><code class=\"lang-shell\">sudo apt-get update\n</code></pre>\n<h3><a id=\"git_9\"></a>安装git</h3>\n<pre><code class=\"lang-shell\">sudo apt-get install git-core\n</code></pre>\n<h2><a id=\"_13\"></a>配置</h2>\n<p>安装完之后，接下来就可以配置git了。<br />\n首先可以检查是否安装成功<br />\n执行</p>\n<pre><code class=\"lang-shell\">git --version\n</code></pre>\n<p>如果看到如下，就说明安装成功。<br />\n<img src=\"https://www.zealsay.com/wp-content/uploads/2018/06/5f9ae0d809b74b68fdd59e87ab5ed1d0.png\" alt=\"\" /></p>\n<h3><a id=\"_22\"></a>设置用户名</h3>\n<pre><code class=\"lang-shell\">git config --global user.name &quot;Tom&quot;\n</code></pre>\n<h3><a id=\"_26\"></a>设置你的电子邮件</h3>\n<pre><code class=\"lang-shell\">\ngit config --global user.email tom@example.com\n</code></pre>\n<p>到此为止，你的git环境已经搭建起来了，可以使用<code>git clone</code> 来克隆一个项目。</p>\n', 'FORMAL', 'ALL', 'git', 220, 0, 1, 1, '2019-07-02 17:43:09', '2019-07-06 11:45:49', 0);
INSERT INTO `article` VALUES (1149213614624739329, '一次滑稽挂掉的科二', '吐槽', 'https://pan.zealsay.com/20190701222747340000000.jpg', '## 一次滑稽挂掉的科二\n早上八点的考试，科目二，嗯，第一次考，虽然最后挂掉了，回想过程还是蛮滑稽的:stuck_out_tongue:，特记录一下。\n#####   开始：\n八点在考试大厅等待 八点半发档案，身份验证，排队开考，我排在第三位。\n##### 入场：\n大屏幕上看到我的名字后面有对应的车号时，我就大步跨向考试入口，看到对应的车号，上车，座椅安全带等准备工作，\n##### 小插曲：\n准备就绪后，旁边的安全员刷上我的身份信息，我准备放下手刹启动车子开始，但是一只手掰了半天也没动静，索性两只手一块掰，仍然纹丝不动，我举手向安全员示意求助，安全员指挥我往上掰，按按钮，仍然没有任何效果，可能他实在看不下去了，直接自己上手掰手刹，我看到他也是相当用力的放下去，完事还嘟囔一句：谁搞这么死的。\n##### 第一次机会：\n启动车子，系统告诉我去3号库，在直行过程中，我在瞅3号库的位置，线呢 库呢，标准线呢（之前模拟的时候，走的是1，2号的库），然后确定的时候发现我马上就到前面基准线了，但是车子太靠近左侧线了，也来不及调整，心里默想怎么办呢，最后硬着头皮接着来吧，果然只要一打方向盘，像预期一样左侧压线了，语音播报扣掉100分，我都还没开始呢，这次机会就这么浪费掉了。。。\n##### 第二次机会：\n4号库，就这么开始了，有了上次的教训，提前看好了各种线，顺利的过了入库，侧方，直角，最后坡起，调整好位置后，在上坡过程中，心里还在想，这次还没扣分呢，我是要过了嘛（快到杆线的时候，看到距离右侧不是很近，要不要再近一点呢，最后想算了，实在不行扣十分也没事，别调近的压线了），刚停车，就听见播报什么什么的超过50cm，扣100分，尼玛，早知道就调近一点啦。\n##### 结果：\n科二华丽丽的挂掉了。', '<h2><a id=\"_0\"></a>一次滑稽挂掉的科二</h2>\n<p>早上八点的考试，科目二，嗯，第一次考，虽然最后挂掉了，回想过程还是蛮滑稽的😛，特记录一下。</p>\n<h5><a id=\"_2\"></a>开始：</h5>\n<p>八点在考试大厅等待 八点半发档案，身份验证，排队开考，我排在第三位。</p>\n<h5><a id=\"_4\"></a>入场：</h5>\n<p>大屏幕上看到我的名字后面有对应的车号时，我就大步跨向考试入口，看到对应的车号，上车，座椅安全带等准备工作，</p>\n<h5><a id=\"_6\"></a>小插曲：</h5>\n<p>准备就绪后，旁边的安全员刷上我的身份信息，我准备放下手刹启动车子开始，但是一只手掰了半天也没动静，索性两只手一块掰，仍然纹丝不动，我举手向安全员示意求助，安全员指挥我往上掰，按按钮，仍然没有任何效果，可能他实在看不下去了，直接自己上手掰手刹，我看到他也是相当用力的放下去，完事还嘟囔一句：谁搞这么死的。</p>\n<h5><a id=\"_8\"></a>第一次机会：</h5>\n<p>启动车子，系统告诉我去3号库，在直行过程中，我在瞅3号库的位置，线呢 库呢，标准线呢（之前模拟的时候，走的是1，2号的库），然后确定的时候发现我马上就到前面基准线了，但是车子太靠近左侧线了，也来不及调整，心里默想怎么办呢，最后硬着头皮接着来吧，果然只要一打方向盘，像预期一样左侧压线了，语音播报扣掉100分，我都还没开始呢，这次机会就这么浪费掉了。。。</p>\n<h5><a id=\"_10\"></a>第二次机会：</h5>\n<p>4号库，就这么开始了，有了上次的教训，提前看好了各种线，顺利的过了入库，侧方，直角，最后坡起，调整好位置后，在上坡过程中，心里还在想，这次还没扣分呢，我是要过了嘛（快到杆线的时候，看到距离右侧不是很近，要不要再近一点呢，最后想算了，实在不行扣十分也没事，别调近的压线了），刚停车，就听见播报什么什么的超过50cm，扣100分，尼玛，早知道就调近一点啦。</p>\n<h5><a id=\"_12\"></a>结果：</h5>\n<p>科二华丽丽的挂掉了。</p>\n', 'FORMAL', 'SELFONLY', '津津原味', 0, 0, 1122417077350035458, 1145341734958014466, '2019-07-11 07:07:32', NULL, 0);
INSERT INTO `article` VALUES (1149215183176994817, '险过科二', '吐槽', 'https://pan.zealsay.com/20190701222747340000000.jpg', '## 险过科二\n##### 待考：\n往常一样，八点，考试大厅校验身份，待考，考虑到不耽误上班，我排在了第二位，开考，9号车\n##### 不良的开始\n上车，调座椅，咦，座椅怎么往前拉不动呀，怎么使劲也不行（以前都是把座椅调整到最前面），这座位比平时往后不少，踩刹车没感觉，坐着也不舒服，最主要影响看镜子，好吧，凑合吧。\n##### 第一次\n入库，过程就是我坐立着，座椅却在后面悬空着，真是极其别扭，右侧勉强没问题，左侧，位置变化导致预判位置误差，入库压着库角线了，直接出去等二次机会。\n##### 脑补插曲\n心里想着要是座椅还是这样，我不能立马适应，结果是必死无疑了，举手示意安全员这个问题，安全员说已经是最大限度，不能调整，好吧，这一次等着挂吧。等待期间，我脑海里都脑补了我向朋友们说我再次挂了，她们怎么安慰我的画面。\n##### 第二次\n死马当活马医吧，入库，侧方，弯道，直角，过去了，又到坡起了，我的大脑又开始活跃了（我不会是要过了吧，又想到上次也是这么想的，又赶紧专注右侧距离），坡起停车，语音说什么保险杠距离没有超过多少里面扣十分。\n##### 结束\n考试结束，居然过了。', '<h2><a id=\"_0\"></a>险过科二</h2>\n<h5><a id=\"_1\"></a>待考：</h5>\n<p>往常一样，八点，考试大厅校验身份，待考，考虑到不耽误上班，我排在了第二位，开考，9号车</p>\n<h5><a id=\"_3\"></a>不良的开始</h5>\n<p>上车，调座椅，咦，座椅怎么往前拉不动呀，怎么使劲也不行（以前都是把座椅调整到最前面），这座位比平时往后不少，踩刹车没感觉，坐着也不舒服，最主要影响看镜子，好吧，凑合吧。</p>\n<h5><a id=\"_5\"></a>第一次</h5>\n<p>入库，过程就是我坐立着，座椅却在后面悬空着，真是极其别扭，右侧勉强没问题，左侧，位置变化导致预判位置误差，入库压着库角线了，直接出去等二次机会。</p>\n<h5><a id=\"_7\"></a>脑补插曲</h5>\n<p>心里想着要是座椅还是这样，我不能立马适应，结果是必死无疑了，举手示意安全员这个问题，安全员说已经是最大限度，不能调整，好吧，这一次等着挂吧。等待期间，我脑海里都脑补了我向朋友们说我再次挂了，她们怎么安慰我的画面。</p>\n<h5><a id=\"_9\"></a>第二次</h5>\n<p>死马当活马医吧，入库，侧方，弯道，直角，过去了，又到坡起了，我的大脑又开始活跃了（我不会是要过了吧，又想到上次也是这么想的，又赶紧专注右侧距离），坡起停车，语音说什么保险杠距离没有超过多少里面扣十分。</p>\n<h5><a id=\"_11\"></a>结束</h5>\n<p>考试结束，居然过了。</p>\n', 'FORMAL', 'SELFONLY', '津津原味', 1, 0, 1122417077350035458, 1145341734958014466, '2019-07-11 07:13:46', NULL, 0);
INSERT INTO `article` VALUES (1151126807270342657, '开发指南', '开发文档', 'https://pan.zealsay.com/20190701222747340000000.jpg', '#  zealsay \n------\n ![beta 1.0.0](https://img.shields.io/badge/beta-1.0.0-ff69b4.svg)\n![spring boot 2.0.4](https://img.shields.io/badge/spring%20boot-2.0.4-green.svg) ![swagger valid ](https://img.shields.io/badge/swagger-valid-brightgreen.svg) ![License MPL-2.0](https://img.shields.io/badge/license-MPL--2.0-green.svg)  [![Build Status](https://travis-ci.org/GodLikeZeal/zealsay_backend.svg?branch=master)](https://travis-ci.org/GodLikeZeal/zealsay_backend) [![](https://img.shields.io/docker/stars/zealsay/zealsay_backend.svg)](https://hub.docker.com/r/zealsay/zealsay_backend \'DockerHub\') [![](https://img.shields.io/docker/pulls/zealsay/zealsay_backend.svg)](https://hub.docker.com/r/zealsay/zealsay_backend \'DockerHub\')\n## 开发指南\n请参考 [开发文档](https://www.zealsay.com)\n## 介绍\n   zealsay是一套前后端分离的快速开发脚手架，后台采用的是最新的`Spring Boot 2.1.6.RELEASE`最新版本，\n   前端使用vue,搭载比较火热的`nuxt.js`服务器端渲染框架，截止到目前,使用的是`nuxt.js`最新`2.8.1`版本,\n   使用`Vuetify`构造出符合 `Material Design` 规范的扁平化风格主题UI,你有对美的偏爱,我同样有一份对美的执着,\n   面对日趋多样化的技术,抽取一些常用的解决方案,以快,轻为主,打造出一个开箱即用的轻应用脚手架,助力中小企业解决\n   快速部署以及持续交付的`DevOps`,本项目为zealsay后台项目，前端项目地址为 [zealsay_front](https://github.com/GodLikeZeal/zealsay_front)\n## 技术选型\n### zealsay_backend（后台项目）\n- Framework : java 8\n- Maven 3.5.4\n- Lombok 1.18.8\n- Spring Boot 2.1.6\n- Spring Security\n- Spring Oauth2 (整合第三方登录)\n- jwt (JSON Web Token)\n- jasypt 加密\n- mapstruct (对象映射)\n- Mybatis + Mybatis Plus (持久层开发利器)\n- Spring Boot Docker (容器服务)\n- Travis CI (自动化构建)\n- Mysql (mysql数据库)\n- Swagger 以及swagger bootstrap-ui (api文档在线生成)\n- RabbitMQ (消息中间件)\n- Redis (Nosql内存数据库)\n- Hikari (高性能连接池)\n- Feign (外部服务调用，整合spring cloud后可以用于内部服务调用)\n- Logback (日志记录)\n- Actuator (服务监控)\n- Junit Test (单元测试)\n- 第三方SDK或服务\n  - 七牛云对象云存储\n  - Github第三方登录\n  - 微信第三方登录\n  - QQ第三方登录\n  - Hitokoto 一言接口\n  - 阿里云短信服务\n  \n\n## 系统架构\n\n这里是架构图\n\n## 本地如何运行\n本地运行可以有两种方式,可以使用传统的运行spring boot应用程序 java -jar 形式,\n如果你本地安装了docker环境的话，也可以使用docker run的方式,\n当然如果你安装了docker-compose,使用编排的方式更简洁直观,用哪种方式运行取决于你的个人喜好。\n\n### 使用传统方式\n#### 运行依赖\n1.  确保本地安装jdk 1.8版本或以上。\n2.  安装maven环境。\n3.  安装git环境。\n4.  安装mysql数据库(如果你有远程的数据库可以不用本地安装)\n5.  安装redis(非必须,如果你不想使用,可以在bootstrap.yml里将redis配置这块去掉)\n6.  安装RabbitMQ(非必须,同理,如果你不想使用,可以在bootstrap.yml里将rabbitmq配置这块去掉)\n#### 代码检出\n`git clone https://github.com/GodLikeZeal/zealsay_backend.git`\n将代码clone到你的本地。\n#### 配置\n-  你可以不使用jasypt加密,直接在`bootstrap.yml`里面配置相关的连接信息,\n当然,如果是一个企业级的项目的话,建议敏感信息还是使用加密保护比较好。\n-  jasypt加密\n1.  可以参考jasypt官方文档,设置必要的相关参数\n2.  比如为了演示，我建立了一个 `Test`\n```java\n  @Test\n  public void testEncrypt() throws Exception {\n    PooledPBEStringEncryptor encryptor = new PooledPBEStringEncryptor();\n    SimpleStringPBEConfig config = new SimpleStringPBEConfig();\n    config.setPassword(\"password\"); //password\n    config.setAlgorithm(\"PBEWithMD5AndDES\"); //加密盐\n    config.setKeyObtentionIterations(\"1000\");\n    config.setPoolSize(\"1\");\n    config.setProviderName(\"SunJCE\"); //providerName\n    config.setSaltGeneratorClassName(\"org.jasypt.salt.RandomSaltGenerator\"); //设置SaltGeneratorClassName\n    config.setStringOutputType(\"base64\"); //输出格式\n    encryptor.setConfig(config);\n    String plainText = \"test\"; //需要加密的字符\n    String encryptedText = encryptor.encrypt(plainText);\n    System.out.println(encryptedText);\n    Assert.assertNotNull(encryptedText);\n  }\n```\n3.  由于使用了 `jasypt` 对敏感信息加密,\n因此可以看到在`bootstrap.yml`中的配置数据库链接部分都是被加密过的,\n你可以选择一个加密的`password`,比如我选择使用`key`作为加密的`password`,\n即`config.setPassword(\"key\");`,假如你要加密的是你数据库的`HOST`域名 `www.xxxx.com`,\n那么可以 `String plainText = \"www.xxxx.com\";`。\n4.  运行启动一下`Test`可以发现在日志打印一串加密后的字符,比如我的执行后得到 `AnoQmUYGtHaw3J/Tdp9SVb9Gr0Gcl69bsCY0cDlqHUGD0mxt9FlGjvEXCB5qfqyDbNulQaZoROw=`\n然后这个值，你就可以在你`bootstrap.yml`配置数据库`HOST`的地方输入了,注意，一定要加上` ENC(你的加密值)`.\n\n#### 启动中间件和数据库\n- 启动mysql数据库,并且以上文所属的方法配置加密后的连接地址以及用户名和密码。\n- 启动redis数据库(如果配置了)\n- 启动RabbitMQ(如果配置了)\n\n#### 启动项目\n-  配置启动参数`jasypt.encryptor.password=你的password`\n-  debug或run 你的`application`\n\n### zealsay blog\n基于zealsay快应用框架构建的博客系统,包含一个blog前端和对应的后台管理系统,为简约,美观和高性能而生。已实现部分功能,项目目前仍在开发中。\n#### 在线预览\n[项目在线预览地址](https://beta.zealsay.com)\n#### 页面展示\n博客首页\n![image.png](https://pan.zealsay.com/20190716214935236000000.png)\n首页文章列表\n![image.png](https://pan.zealsay.com/20190716214936313000000.png)\n博客详情页\n![image.png](https://pan.zealsay.com/20190716214936530000000.png)\n后台登录页面\n![image.png](https://pan.zealsay.com/20190716214936631000000.png)\ndashboard\n![image.png](https://pan.zealsay.com/20190716214937367000000.png)\n用户列表\n![image.png](https://pan.zealsay.com/20190716214937929000000.png)\n文章添加\n![image.png](https://pan.zealsay.com/20190716214938738000000.png)\nmarkdown编辑器\n![image.png](https://pan.zealsay.com/20190716214939591000000.png)\n标签云管理\n![image.png](https://pan.zealsay.com/2019071621494080000000.png)\n主题设置\n![image.png](https://pan.zealsay.com/20190716214940767000000.png)\n#### TODO LIST\n*  登录模块\n* [x] 用户名密码登录 \n* [ ] Github第三方登录 \n* [ ] 微信第三方登录 \n* [ ] QQ第三方登录 \n* [x] 登录背景动态气泡效果\n*  用户模块\n* [x] 后台用户列表条件搜索\n* [x] 后台用户添加,删除\n* [x] 后台用户修改\n* [x] 后台用户详情\n* [x] 后台用户封禁解封\n* [ ] 个人中心(blog端和后台)\n* [ ] 用户等级level以及称号\n*  角色模块\n* [x] 角色列表\n* [x] 角色添加,删除\n* [x] 角色修改\n* [x] 角色详情\n*  文章模块\n* [x] 文章列表条件搜索\n* [x] 文章添加,删除\n* [x] 文章修改\n* [x] 文章预览\n* [x] 文章上下架\n* [x] blog端首页文章列表\n* [x] blog端根据类型搜索文章列表\n* [x] blog端根据标签label搜索文章列表\n* 标签云模块\n* [x] 标签列表条件搜索\n* [x] 标签添加,删除\n* [x] blog端标签云展示\n* [ ] blog端标签云动态气泡效果\n* 分类目录模块\n* [x] 分类目录树\n* [x] 分类目录添加,删除\n* [x] 分类目录修改\n* 其他模块\n* [x] 图片上传到服务器\n* [x] 图片裁剪\n* [x] sweetalert2弹窗样式自定义\n* [ ] 解决sweetalert2弹窗按钮颜色不能马上生效\n* [x] 增加markdown编辑器\n* [x] 首页鼠标hover图片变大动画效果\n* [ ] 博客端文章增加点赞功能\n* [ ] 博客端文章增加浏览量功能\n* [ ] 博客端关于页面，个人信息展示\n* [ ] 博客端评论系统\n* [ ] 用户自定义站点资源，如站点名称,meta,以及seo优化等\n* [ ] 博客端友链页面card展示\n* [ ] 后台dashboard流量，访问统计以及最新动态\n### 交流群\n![WechatIMG3.jpeg](https://pan.zealsay.com/20190716214941558000000.jpg)\n### 鸣谢\n\n- :kissing_heart::kissing_heart:感谢前端大佬[jinjinyike](https://github.com/jinjinyike)的顾问级别的帮助。\n- :heart::heart:最后感谢兜兜里有糖的理解和支持,没有她我完不成此项目,别问为什么,晚上不睡觉写代码会被打。\n- 更多关于nuxt文档,可以访问 [Nuxt.js docs](https://nuxtjs.org).', '<h1><a id=\"zealsay_0\"></a>zealsay</h1>\n<hr />\n<p><img src=\"https://img.shields.io/badge/beta-1.0.0-ff69b4.svg\" alt=\"beta 1.0.0\" /><br />\n<img src=\"https://img.shields.io/badge/spring%20boot-2.0.4-green.svg\" alt=\"spring boot 2.0.4\" /> <img src=\"https://img.shields.io/badge/swagger-valid-brightgreen.svg\" alt=\"swagger valid \" /> <img src=\"https://img.shields.io/badge/license-MPL--2.0-green.svg\" alt=\"License MPL-2.0\" />  <a href=\"https://travis-ci.org/GodLikeZeal/zealsay_backend\" target=\"_blank\"><img src=\"https://travis-ci.org/GodLikeZeal/zealsay_backend.svg?branch=master\" alt=\"Build Status\" /></a> <a href=\"https://hub.docker.com/r/zealsay/zealsay_backend\" title=\"DockerHub\" target=\"_blank\"><img src=\"https://img.shields.io/docker/stars/zealsay/zealsay_backend.svg\" alt=\"\" /></a> <a href=\"https://hub.docker.com/r/zealsay/zealsay_backend\" title=\"DockerHub\" target=\"_blank\"><img src=\"https://img.shields.io/docker/pulls/zealsay/zealsay_backend.svg\" alt=\"\" /></a></p>\n<h2><a id=\"_4\"></a>开发指南</h2>\n<p>请参考 <a href=\"https://www.zealsay.com\" target=\"_blank\">开发文档</a></p>\n<h2><a id=\"_6\"></a>介绍</h2>\n<p>zealsay是一套前后端分离的快速开发脚手架，后台采用的是最新的<code>Spring Boot 2.1.6.RELEASE</code>最新版本，<br />\n前端使用vue,搭载比较火热的<code>nuxt.js</code>服务器端渲染框架，截止到目前,使用的是<code>nuxt.js</code>最新<code>2.8.1</code>版本,<br />\n使用<code>Vuetify</code>构造出符合 <code>Material Design</code> 规范的扁平化风格主题UI,你有对美的偏爱,我同样有一份对美的执着,<br />\n面对日趋多样化的技术,抽取一些常用的解决方案,以快,轻为主,打造出一个开箱即用的轻应用脚手架,助力中小企业解决<br />\n快速部署以及持续交付的<code>DevOps</code>,本项目为zealsay后台项目，前端项目地址为 <a href=\"https://github.com/GodLikeZeal/zealsay_front\" target=\"_blank\">zealsay_front</a></p>\n<h2><a id=\"_12\"></a>技术选型</h2>\n<h3><a id=\"zealsay_backend_13\"></a>zealsay_backend（后台项目）</h3>\n<ul>\n<li>Framework : java 8</li>\n<li>Maven 3.5.4</li>\n<li>Lombok 1.18.8</li>\n<li>Spring Boot 2.1.6</li>\n<li>Spring Security</li>\n<li>Spring Oauth2 (整合第三方登录)</li>\n<li>jwt (JSON Web Token)</li>\n<li>jasypt 加密</li>\n<li>mapstruct (对象映射)</li>\n<li>Mybatis + Mybatis Plus (持久层开发利器)</li>\n<li>Spring Boot Docker (容器服务)</li>\n<li>Travis CI (自动化构建)</li>\n<li>Mysql (mysql数据库)</li>\n<li>Swagger 以及swagger bootstrap-ui (api文档在线生成)</li>\n<li>RabbitMQ (消息中间件)</li>\n<li>Redis (Nosql内存数据库)</li>\n<li>Hikari (高性能连接池)</li>\n<li>Feign (外部服务调用，整合spring cloud后可以用于内部服务调用)</li>\n<li>Logback (日志记录)</li>\n<li>Actuator (服务监控)</li>\n<li>Junit Test (单元测试)</li>\n<li>第三方SDK或服务\n<ul>\n<li>七牛云对象云存储</li>\n<li>Github第三方登录</li>\n<li>微信第三方登录</li>\n<li>QQ第三方登录</li>\n<li>Hitokoto 一言接口</li>\n<li>阿里云短信服务</li>\n</ul>\n</li>\n</ul>\n<h2><a id=\"_44\"></a>系统架构</h2>\n<p>这里是架构图</p>\n<h2><a id=\"_48\"></a>本地如何运行</h2>\n<p>本地运行可以有两种方式,可以使用传统的运行spring boot应用程序 java -jar 形式,<br />\n如果你本地安装了docker环境的话，也可以使用docker run的方式,<br />\n当然如果你安装了docker-compose,使用编排的方式更简洁直观,用哪种方式运行取决于你的个人喜好。</p>\n<h3><a id=\"_53\"></a>使用传统方式</h3>\n<h4><a id=\"_54\"></a>运行依赖</h4>\n<ol>\n<li>确保本地安装jdk 1.8版本或以上。</li>\n<li>安装maven环境。</li>\n<li>安装git环境。</li>\n<li>安装mysql数据库(如果你有远程的数据库可以不用本地安装)</li>\n<li>安装redis(非必须,如果你不想使用,可以在bootstrap.yml里将redis配置这块去掉)</li>\n<li>安装RabbitMQ(非必须,同理,如果你不想使用,可以在bootstrap.yml里将rabbitmq配置这块去掉)</li>\n</ol>\n<h4><a id=\"_61\"></a>代码检出</h4>\n<p><code>git clone https://github.com/GodLikeZeal/zealsay_backend.git</code><br />\n将代码clone到你的本地。</p>\n<h4><a id=\"_64\"></a>配置</h4>\n<ul>\n<li>你可以不使用jasypt加密,直接在<code>bootstrap.yml</code>里面配置相关的连接信息,<br />\n当然,如果是一个企业级的项目的话,建议敏感信息还是使用加密保护比较好。</li>\n<li>jasypt加密</li>\n</ul>\n<ol>\n<li>可以参考jasypt官方文档,设置必要的相关参数</li>\n<li>比如为了演示，我建立了一个 <code>Test</code></li>\n</ol>\n<pre><div class=\"hljs\"><code class=\"lang-java\">  <span class=\"hljs-meta\">@Test</span>\n  <span class=\"hljs-function\"><span class=\"hljs-keyword\">public</span> <span class=\"hljs-keyword\">void</span> <span class=\"hljs-title\">testEncrypt</span><span class=\"hljs-params\">()</span> <span class=\"hljs-keyword\">throws</span> Exception </span>{\n    PooledPBEStringEncryptor encryptor = <span class=\"hljs-keyword\">new</span> PooledPBEStringEncryptor();\n    SimpleStringPBEConfig config = <span class=\"hljs-keyword\">new</span> SimpleStringPBEConfig();\n    config.setPassword(<span class=\"hljs-string\">\"password\"</span>); <span class=\"hljs-comment\">//password</span>\n    config.setAlgorithm(<span class=\"hljs-string\">\"PBEWithMD5AndDES\"</span>); <span class=\"hljs-comment\">//加密盐</span>\n    config.setKeyObtentionIterations(<span class=\"hljs-string\">\"1000\"</span>);\n    config.setPoolSize(<span class=\"hljs-string\">\"1\"</span>);\n    config.setProviderName(<span class=\"hljs-string\">\"SunJCE\"</span>); <span class=\"hljs-comment\">//providerName</span>\n    config.setSaltGeneratorClassName(<span class=\"hljs-string\">\"org.jasypt.salt.RandomSaltGenerator\"</span>); <span class=\"hljs-comment\">//设置SaltGeneratorClassName</span>\n    config.setStringOutputType(<span class=\"hljs-string\">\"base64\"</span>); <span class=\"hljs-comment\">//输出格式</span>\n    encryptor.setConfig(config);\n    String plainText = <span class=\"hljs-string\">\"test\"</span>; <span class=\"hljs-comment\">//需要加密的字符</span>\n    String encryptedText = encryptor.encrypt(plainText);\n    System.out.println(encryptedText);\n    Assert.assertNotNull(encryptedText);\n  }\n</code></div></pre>\n<ol start=\"3\">\n<li>由于使用了 <code>jasypt</code> 对敏感信息加密,<br />\n因此可以看到在<code>bootstrap.yml</code>中的配置数据库链接部分都是被加密过的,<br />\n你可以选择一个加密的<code>password</code>,比如我选择使用<code>key</code>作为加密的<code>password</code>,<br />\n即<code>config.setPassword(&quot;key&quot;);</code>,假如你要加密的是你数据库的<code>HOST</code>域名 <code>www.xxxx.com</code>,<br />\n那么可以 <code>String plainText = &quot;www.xxxx.com&quot;;</code>。</li>\n<li>运行启动一下<code>Test</code>可以发现在日志打印一串加密后的字符,比如我的执行后得到 <code>AnoQmUYGtHaw3J/Tdp9SVb9Gr0Gcl69bsCY0cDlqHUGD0mxt9FlGjvEXCB5qfqyDbNulQaZoROw=</code><br />\n然后这个值，你就可以在你<code>bootstrap.yml</code>配置数据库<code>HOST</code>的地方输入了,注意，一定要加上<code>ENC(你的加密值)</code>.</li>\n</ol>\n<h4><a id=\"_97\"></a>启动中间件和数据库</h4>\n<ul>\n<li>启动mysql数据库,并且以上文所属的方法配置加密后的连接地址以及用户名和密码。</li>\n<li>启动redis数据库(如果配置了)</li>\n<li>启动RabbitMQ(如果配置了)</li>\n</ul>\n<h4><a id=\"_102\"></a>启动项目</h4>\n<ul>\n<li>配置启动参数<code>jasypt.encryptor.password=你的password</code></li>\n<li>debug或run 你的<code>application</code></li>\n</ul>\n<h3><a id=\"zealsay_blog_106\"></a>zealsay blog</h3>\n<p>基于zealsay快应用框架构建的博客系统,包含一个blog前端和对应的后台管理系统,为简约,美观和高性能而生。已实现部分功能,项目目前仍在开发中。</p>\n<h4><a id=\"_108\"></a>在线预览</h4>\n<p><a href=\"https://beta.zealsay.com\" target=\"_blank\">项目在线预览地址</a></p>\n<h4><a id=\"_110\"></a>页面展示</h4>\n<p>博客首页<br />\n<img src=\"https://pan.zealsay.com/20190716214935236000000.png\" alt=\"image.png\" /><br />\n首页文章列表<br />\n<img src=\"https://pan.zealsay.com/20190716214936313000000.png\" alt=\"image.png\" /><br />\n博客详情页<br />\n<img src=\"https://pan.zealsay.com/20190716214936530000000.png\" alt=\"image.png\" /><br />\n后台登录页面<br />\n<img src=\"https://pan.zealsay.com/20190716214936631000000.png\" alt=\"image.png\" /><br />\ndashboard<br />\n<img src=\"https://pan.zealsay.com/20190716214937367000000.png\" alt=\"image.png\" /><br />\n用户列表<br />\n<img src=\"https://pan.zealsay.com/20190716214937929000000.png\" alt=\"image.png\" /><br />\n文章添加<br />\n<img src=\"https://pan.zealsay.com/20190716214938738000000.png\" alt=\"image.png\" /><br />\nmarkdown编辑器<br />\n<img src=\"https://pan.zealsay.com/20190716214939591000000.png\" alt=\"image.png\" /><br />\n标签云管理<br />\n<img src=\"https://pan.zealsay.com/2019071621494080000000.png\" alt=\"image.png\" /><br />\n主题设置<br />\n<img src=\"https://pan.zealsay.com/20190716214940767000000.png\" alt=\"image.png\" /></p>\n<h4><a id=\"TODO_LIST_131\"></a>TODO LIST</h4>\n<ul class=\"contains-task-list\">\n<li>登录模块</li>\n<li class=\"task-list-item\"><input class=\"task-list-item-checkbox\" checked=\"\" disabled=\"\" type=\"checkbox\"> 用户名密码登录</li>\n<li class=\"task-list-item\"><input class=\"task-list-item-checkbox\" disabled=\"\" type=\"checkbox\"> Github第三方登录</li>\n<li class=\"task-list-item\"><input class=\"task-list-item-checkbox\" disabled=\"\" type=\"checkbox\"> 微信第三方登录</li>\n<li class=\"task-list-item\"><input class=\"task-list-item-checkbox\" disabled=\"\" type=\"checkbox\"> QQ第三方登录</li>\n<li class=\"task-list-item\"><input class=\"task-list-item-checkbox\" checked=\"\" disabled=\"\" type=\"checkbox\"> 登录背景动态气泡效果</li>\n<li>用户模块</li>\n<li class=\"task-list-item\"><input class=\"task-list-item-checkbox\" checked=\"\" disabled=\"\" type=\"checkbox\"> 后台用户列表条件搜索</li>\n<li class=\"task-list-item\"><input class=\"task-list-item-checkbox\" checked=\"\" disabled=\"\" type=\"checkbox\"> 后台用户添加,删除</li>\n<li class=\"task-list-item\"><input class=\"task-list-item-checkbox\" checked=\"\" disabled=\"\" type=\"checkbox\"> 后台用户修改</li>\n<li class=\"task-list-item\"><input class=\"task-list-item-checkbox\" checked=\"\" disabled=\"\" type=\"checkbox\"> 后台用户详情</li>\n<li class=\"task-list-item\"><input class=\"task-list-item-checkbox\" checked=\"\" disabled=\"\" type=\"checkbox\"> 后台用户封禁解封</li>\n<li class=\"task-list-item\"><input class=\"task-list-item-checkbox\" disabled=\"\" type=\"checkbox\"> 个人中心(blog端和后台)</li>\n<li class=\"task-list-item\"><input class=\"task-list-item-checkbox\" disabled=\"\" type=\"checkbox\"> 用户等级level以及称号</li>\n<li>角色模块</li>\n<li class=\"task-list-item\"><input class=\"task-list-item-checkbox\" checked=\"\" disabled=\"\" type=\"checkbox\"> 角色列表</li>\n<li class=\"task-list-item\"><input class=\"task-list-item-checkbox\" checked=\"\" disabled=\"\" type=\"checkbox\"> 角色添加,删除</li>\n<li class=\"task-list-item\"><input class=\"task-list-item-checkbox\" checked=\"\" disabled=\"\" type=\"checkbox\"> 角色修改</li>\n<li class=\"task-list-item\"><input class=\"task-list-item-checkbox\" checked=\"\" disabled=\"\" type=\"checkbox\"> 角色详情</li>\n<li>文章模块</li>\n<li class=\"task-list-item\"><input class=\"task-list-item-checkbox\" checked=\"\" disabled=\"\" type=\"checkbox\"> 文章列表条件搜索</li>\n<li class=\"task-list-item\"><input class=\"task-list-item-checkbox\" checked=\"\" disabled=\"\" type=\"checkbox\"> 文章添加,删除</li>\n<li class=\"task-list-item\"><input class=\"task-list-item-checkbox\" checked=\"\" disabled=\"\" type=\"checkbox\"> 文章修改</li>\n<li class=\"task-list-item\"><input class=\"task-list-item-checkbox\" checked=\"\" disabled=\"\" type=\"checkbox\"> 文章预览</li>\n<li class=\"task-list-item\"><input class=\"task-list-item-checkbox\" checked=\"\" disabled=\"\" type=\"checkbox\"> 文章上下架</li>\n<li class=\"task-list-item\"><input class=\"task-list-item-checkbox\" checked=\"\" disabled=\"\" type=\"checkbox\"> blog端首页文章列表</li>\n<li class=\"task-list-item\"><input class=\"task-list-item-checkbox\" checked=\"\" disabled=\"\" type=\"checkbox\"> blog端根据类型搜索文章列表</li>\n<li class=\"task-list-item\"><input class=\"task-list-item-checkbox\" checked=\"\" disabled=\"\" type=\"checkbox\"> blog端根据标签label搜索文章列表</li>\n<li>标签云模块</li>\n<li class=\"task-list-item\"><input class=\"task-list-item-checkbox\" checked=\"\" disabled=\"\" type=\"checkbox\"> 标签列表条件搜索</li>\n<li class=\"task-list-item\"><input class=\"task-list-item-checkbox\" checked=\"\" disabled=\"\" type=\"checkbox\"> 标签添加,删除</li>\n<li class=\"task-list-item\"><input class=\"task-list-item-checkbox\" checked=\"\" disabled=\"\" type=\"checkbox\"> blog端标签云展示</li>\n<li class=\"task-list-item\"><input class=\"task-list-item-checkbox\" disabled=\"\" type=\"checkbox\"> blog端标签云动态气泡效果</li>\n<li>分类目录模块</li>\n<li class=\"task-list-item\"><input class=\"task-list-item-checkbox\" checked=\"\" disabled=\"\" type=\"checkbox\"> 分类目录树</li>\n<li class=\"task-list-item\"><input class=\"task-list-item-checkbox\" checked=\"\" disabled=\"\" type=\"checkbox\"> 分类目录添加,删除</li>\n<li class=\"task-list-item\"><input class=\"task-list-item-checkbox\" checked=\"\" disabled=\"\" type=\"checkbox\"> 分类目录修改</li>\n<li>其他模块</li>\n<li class=\"task-list-item\"><input class=\"task-list-item-checkbox\" checked=\"\" disabled=\"\" type=\"checkbox\"> 图片上传到服务器</li>\n<li class=\"task-list-item\"><input class=\"task-list-item-checkbox\" checked=\"\" disabled=\"\" type=\"checkbox\"> 图片裁剪</li>\n<li class=\"task-list-item\"><input class=\"task-list-item-checkbox\" checked=\"\" disabled=\"\" type=\"checkbox\"> sweetalert2弹窗样式自定义</li>\n<li class=\"task-list-item\"><input class=\"task-list-item-checkbox\" disabled=\"\" type=\"checkbox\"> 解决sweetalert2弹窗按钮颜色不能马上生效</li>\n<li class=\"task-list-item\"><input class=\"task-list-item-checkbox\" checked=\"\" disabled=\"\" type=\"checkbox\"> 增加markdown编辑器</li>\n<li class=\"task-list-item\"><input class=\"task-list-item-checkbox\" checked=\"\" disabled=\"\" type=\"checkbox\"> 首页鼠标hover图片变大动画效果</li>\n<li class=\"task-list-item\"><input class=\"task-list-item-checkbox\" disabled=\"\" type=\"checkbox\"> 博客端文章增加点赞功能</li>\n<li class=\"task-list-item\"><input class=\"task-list-item-checkbox\" disabled=\"\" type=\"checkbox\"> 博客端文章增加浏览量功能</li>\n<li class=\"task-list-item\"><input class=\"task-list-item-checkbox\" disabled=\"\" type=\"checkbox\"> 博客端关于页面，个人信息展示</li>\n<li class=\"task-list-item\"><input class=\"task-list-item-checkbox\" disabled=\"\" type=\"checkbox\"> 博客端评论系统</li>\n<li class=\"task-list-item\"><input class=\"task-list-item-checkbox\" disabled=\"\" type=\"checkbox\"> 用户自定义站点资源，如站点名称,meta,以及seo优化等</li>\n<li class=\"task-list-item\"><input class=\"task-list-item-checkbox\" disabled=\"\" type=\"checkbox\"> 博客端友链页面card展示</li>\n<li class=\"task-list-item\"><input class=\"task-list-item-checkbox\" disabled=\"\" type=\"checkbox\"> 后台dashboard流量，访问统计以及最新动态</li>\n</ul>\n<h3><a id=\"_183\"></a>交流群</h3>\n<p><img src=\"https://pan.zealsay.com/20190716214941558000000.jpg\" alt=\"WechatIMG3.jpeg\" /></p>\n<h3><a id=\"_185\"></a>鸣谢</h3>\n<ul>\n<li>😘😘感谢前端大佬<a href=\"https://github.com/jinjinyike\" target=\"_blank\">jinjinyike</a>的顾问级别的帮助。</li>\n<li>❤️❤️最后感谢兜兜里有糖的理解和支持,没有她我完不成此项目,别问为什么,晚上不睡觉写代码会被打。</li>\n<li>更多关于nuxt文档,可以访问 <a href=\"https://nuxtjs.org\" target=\"_blank\">Nuxt.js docs</a>.</li>\n</ul>\n', 'DRAFT', 'ALL', 'docker', 2, 0, 1149156444177149953, 1, '2019-07-16 21:49:42', NULL, 0);
INSERT INTO `article` VALUES (1214761089041395714, '解决Mac OS 升级后npm报错', 'gyp:No Xcode or CLT version', 'https://pic.zealsay.com/article/20200108120940611000000.jpg', '**今天将node的版本和npm版本升级后，发现执行npm报gyp: No Xcode or CLT version detected! 的错误，找了半天不知道咋解决，刚开始以为是npm依赖无法加载，打开梯子或尝试`` cnpm i``也不好使，后来猛然想起是不是跟前段时间升级mac os 有关系，一查果然如此。**\n### 报错信息\n\n![image.png](https://pic.zealsay.com/2020010812094772000000.png)\n\n### 解决方案\n\n安装xcode 的CLI 工具即可，执行\n`` sudo xcode-select --install``', '<p><strong>今天将node的版本和npm版本升级后，发现执行npm报gyp: No Xcode or CLT version detected! 的错误，找了半天不知道咋解决，刚开始以为是npm依赖无法加载，打开梯子或尝试<code> cnpm i</code>也不好使，后来猛然想起是不是跟前段时间升级mac os 有关系，一查果然如此。</strong></p>\n<h3><a id=\"_1\"></a>报错信息</h3>\n<p><img src=\"https://pic.zealsay.com/2020010812094772000000.png\" alt=\"image.png\" /></p>\n<h3><a id=\"_5\"></a>解决方案</h3>\n<p>安装xcode 的CLI 工具即可，执行<br />\n<code> sudo xcode-select --install</code></p>\n', 'FORMAL', 'ALL', 'ios,node', 139, 0, 1, 1, '2020-01-08 12:09:47', '2020-07-05 20:42:46', 0);
