INSERT INTO `phrase` VALUES (1, '与众不同的生活方式很累人呢，因为找不到借口。', 'a', '幸运星', '跳舞的果果', '1970-01-17');
INSERT INTO `phrase` VALUES (2, '面对就好，去经历就好。', 'a', '花伞菌', 'umbrella', '1970-01-18');
INSERT INTO `phrase` VALUES (3, '将愿望倾入不愿忘却的回忆中……', 'a', 'ef-a tale of memories', 'lqsasa', '1970-01-18');
INSERT INTO `phrase` VALUES (4, '美好的人眼里映出的世界也是美好的。', 'a', 'ARIA', 'misaki', '1970-01-18');
INSERT INTO `phrase` VALUES (5, '看似美好的东西，往往藏着陷阱。', 'a', '只有神知道的世界', '紫月岚', '1970-01-18');
INSERT INTO `phrase` VALUES (6, '天空是连着的，如果我们也能各自发光的话，无论距离有多远，都能看到彼此努力的身影。', 'a', '龙虎斗', 'Sai', '1970-01-17');
INSERT INTO `phrase` VALUES (7, '恋ではなく、爱でもなく、もっとずっと 深く重い。', 'a', 'sweet   pool', '占星术杀人魔法', '1970-01-18');
INSERT INTO `phrase` VALUES (8, '花开花落，再灿烂的星光也会消失。', 'a', '圣斗士星矢', '水幻之音', '1970-01-18');
INSERT INTO `phrase` VALUES (9, '挡着在我们面前的是巨大庞然的人生，阻隔在我们中间的是广阔无际的时间，对于他们，我们无能为力……', 'a', '秒速五厘米', 'zjl4835751', '1970-01-18');
INSERT INTO `phrase` VALUES (10, '我是一个经常笑的人，可我不是经常开心的人。', 'a', '未闻花名', 'Sai', '1970-01-18');
